    "content": "Vai al contenuto Da Wikipedia, l\u0027enciclopedia libera. Benvenuti su Wikipedia L\u0027enciclopedia libera e collaborativa Sfoglia l\u0027indice Consulta il sommario Naviga tra i portali tematici 1 948 257 voci in italiano Versione per dispositivi mobili Versione desktop Wikipedia Wikipedia ├и un\u0027enciclopedia online, libera e collaborativa. Grazie al contributo di volontari da tutto il mondo, Wikipedia ├и disponibile in oltre 340 lingue. Chiunque pu├▓ contribuire alle voci esistenti o crearne di nuove, affrontando sia gli argomenti tipici delle enciclopedie tradizionali sia quelli presenti in almanacchi, dizionari geografici e pubblicazioni specialistiche. Tutti i contenuti di Wikipedia sono protetti da una licenza libera, la Creative Commons CC BY-SA, che ne permette il riutilizzo per qualsiasi scopo a condizione di adottare la medesima licenza. Cosa posso fare? Vuoi partecipare? Leggi le regole fondamentali e le altre linee guida, e rispetta la wikiquette; la registrazione ├и consigliata ma non obbligatoria. Serve aiuto? Consulta le istruzioni e le domande frequenti (FAQ) o leggi dove fare una domanda; se ti sei appena registrato puoi richiedere l\u0027assegnazione di un tutor. Vuoi provare? Modifica la pagina di prova o segui il Tour guidato per imparare come scrivere una voce. Vuoi fare una donazione? Wikipedia ├и completamente gratuita e priva di pubblicit├а grazie alle donazioni degli utenti. Aiutaci a migliorarla e a mantenerla libera con una donazione. Cosa pensi di Wikipedia? Scrivi il tuo parere. Chi fa Wikipedia? La comunit├а di Wikipedia in lingua italiana ├и composta da 2 795 519 utenti registrati, dei quali 32 371 hanno contribuito con almeno una modifica nell\u0027ultimo mese e 107 hanno funzioni di servizio. Gli utenti costituiscono una comunit├а collaborativa, in cui tutti i membri, grazie anche ai progetti tematici e ai rispettivi luoghi di discussione, coordinano i propri sforzi nella redazione delle voci. Vetrina Il teatro dell\u0027Artico della seconda guerra mondiale, parte del pi├╣ vasto teatro scandinavo del secondo conflitto mondiale, vide contrapporsi da una parte le forze della Germania e della Finlandia (quest\u0027ultima fino all\u0027armistizio del 19 settembre 1944), e dall\u0027altra le forze degli Alleati, e in particolar modo quelle di Regno Unito, Unione Sovietica, Norvegia e Stati Uniti d\u0027America; le operazioni militari svoltesi al di sopra del circolo polare artico compresero attivit├а terrestri, navali ed aeree. Le operazioni terrestri videro, nell\u0027aprile del 1940, le forze tedesche impossessarsi con un\u0027operazione anfibia dell\u0027importante porto norvegese di Narvik, affrontando poi con successo il contrattacco di un corpo di spedizione anglo-francese. Successivamente, a seguito dell\u0027avvio dell\u0027operazione Barbarossa nel giugno del 1941, truppe tedesche e finlandesi aprirono un fronte di guerra nel nord della Lapponia, puntando alla conquista dello strategico porto sovietico di Murmansk; dopo l\u0027abbandono dell\u0027alleanza con i tedeschi nel settembre del 1944, i finlandesi cooperarono coi sovietici per cacciare i reparti della Wehrmacht dalla Lapponia e dal nord della Norvegia. Contemporaneamente, unit├а speciali britanniche, appartenenti al corpo dei British Commandos, condussero una serie di incursioni contro le installazioni tedesche in Norvegia, mentre scontri minori e azioni su piccola scala finirono per interessare anche territori remoti come le isole Svalbard o la costa orientale della Groenlandia. A dispetto del clima ostile, le acque dell\u0027artico videro un\u0027intensa attivit├а aeronavale durante quasi tutto l\u0027arco del conflitto: in particolare, la Kriegsmarine da un lato e la Royal Navy e le marine militari alleate (soprattutto la Flotta del Nord sovietica, la United States Navy e la Royal Canadian Navy) dall\u0027altro, supportate dalle rispettive forze aeree, ingaggiarono una serrata lotta lungo la rotta tra l\u0027Islanda e Murmansk, utilizzata dagli Alleati per far giungere in URSS massicci quantitativi di armi e materiale bellico ceduti ai sovietici nell\u0027ambito degli accordi Lend-Lease; ripetute furono anche le incursioni dei gruppi navali e delle forze aeree anglo-statunitensi contro le basi navali tedesche nel nord della Norvegia, volte alla caccia e alla distruzione delle principali unit├а da battaglia della Kriegsmarine. Leggi la voce ┬╖ Tutte le voci in vetrina Voci di qualit├а La tartaruga del muschio carenata (Sternotherus carinatus Gray, 1855), ├и una tartaruga carnivora membro della famiglia Kinosternidae. Di piccole dimensioni, il carapace raggiunge solitamente una lunghezza compresa tra i 13 e i 16 cm. Il suo areale ├и compreso nel centro-sud degli Stati Uniti, dove, nonostante alcune minacce derivate dalle attivit├а antropica, ├и classificata come una specie a basso rischio. In virt├╣ delle piccole dimensioni, questo rettile ├и spesso venduto e allevato come animale da compagnia. Questa tartaruga abita tipicamente corsi d\u0027acqua ricchi di vegetazione acquatica e con fondali di sabbia, ghiaia e ciottoli ma ├и possibile trovarla anch",
