    "content": "Meowcat767 Hello there! ЁЯСЛ I\u0027m a Java software developer, and my current focus is my implementation of mct (Meowcat\u0027s Text Editor). ЁЯТб Want to download it? Check out the file server About Me I\u0027m a Java software developer passionate about creating useful tools and applications. Currently, I\u0027m focused on developing mct (Meowcat\u0027s Text Editor), a text editor implementation that I\u0027m building from the ground up. I maintain 28+ repositories across GitHub and my self-hosted Gitea instance. Most of my active development work happens on my Gitea server, where I work on various projects ranging from web applications to system utilities. When I\u0027m not coding, I enjoy contributing to open source projects, experimenting with new technologies, and building tools that make development workflows smoother. ЁЯРЩ GitHub ЁЯФз Gitea Main workspace Featured Projects mct (Meowcat\u0027s Text Editor) Java My implementation of a text editor, built with Java. Currently in active development and available for download. Download osu! Taiko MIDI Drums Python A Python tool for connecting MIDI Electronic Drum Kits to osu!(lazer) on Linux. Enables using real drum kits with osu!. View on GitHub Viewed Java Viewed is an MPEG/AAC/Other open format media player. View on GitHub Rolling Girl for micro:bit Embedded Wowaka\u0027s \"Rolling Girl\" implemented for the BBC micro:bit. Plays the song using a connected speaker or buzzer. View on GitHub More Projects Explore Check out all my projects on GitHub and Gitea. Most of my active work is on my self-hosted Gitea instance. GitHub Gitea ЁЯХР 00:00:00 Current Time ЁЯТб Loading... Did You Know? Quick Links ЁЯЦ╝я╕П Gallery Images of all time ЁЯТ╗ Projects My open source work ЁЯУК Status Service status ЁЯФз Git Server Code repository ЁЯУж File Server Downloads \u0026 files",
