    "content": "Jump to content From Wikipedia, the free encyclopedia Free and open-source object relational database management system PostgreSQL The World\u0027s Most Advanced Open Source Relational Database[1] Developer PostgreSQL Global Development Group[2] Initial release 8 July 1996; 29 years ago (1996-07-08)[3] Stable release 18.1[4] / 13 November 2025 Repository git.postgresql.org/gitweb/?p\u003dpostgresql.git Written in C (and C++ for the LLVM dependency) Type RDBMS License PostgreSQL License (free and open-source, permissive)[5][6][7] Website www.postgresql.org PostgreSQL License[5] Publisher PostgreSQL Global Development Group Regents of the University of California Debian FSG compatible Yes[8][9] FSF approved Yes[10] OSI approved Yes[7] GPL compatible Yes Copyleft No Linking from code with a different licence Yes Website postgresql.org/about/licence PostgreSQL (/╦Мpo╩Кst╔бr╔Ыskju╦И╔Ыl/ тУШ POHST-gres-kew-EL)[11][12] also known as Postgres, is a free and open-source relational database management system (RDBMS) emphasizing extensibility and SQL compliance. PostgreSQL features transactions with atomicity, consistency, isolation, durability (ACID) properties, automatically updatable views, materialized views, triggers, foreign keys, and stored procedures.[13] It is supported on all major operating systems, including Windows, Linux, macOS, FreeBSD, and OpenBSD, and handles a range of workloads from single machines to data warehouses, data lakes,[14] or web services with many concurrent users. The PostgreSQL Global Development Group focuses only on developing a database engine and closely related components. This core is, technically, what comprises PostgreSQL itself, but there is an extensive developer community and ecosystem that provides other important feature sets that might, traditionally, be provided by a proprietary software vendor. These include special-purpose database engine features, like those needed to support a geospatial[15] or temporal[16] database or features which emulate other database products.[17][18][19][20] Also available from third parties are a wide variety of user and machine interface features, such as graphical user interfaces[21][22][23] or load balancing and high availability toolsets.[24] The large third-party PostgreSQL support network of people, companies, products, and projects, even though not part of The PostgreSQL Development Group, are essential to the PostgreSQL database engine\u0027s adoption and use and make up the PostgreSQL ecosystem writ large.[25] PostgreSQL was originally named POSTGRES, referring to its origins as a successor to the Ingres database developed at the University of California, Berkeley.[26][27] In 1996, the project was renamed PostgreSQL to reflect its support for SQL. After a review in 2007, the development team decided to keep the name PostgreSQL and the alias Postgres.[28] History [edit] Ingres and University POSTGRES (1982тАУ1994) [edit] PostgreSQL evolved from the Ingres project at the University of California, Berkeley. In 1982, the leader of the Ingres team, Michael Stonebraker, left Berkeley to make a proprietary version of Ingres.[26] He returned to Berkeley in 1985, and began a post-Ingres project to address the problems with contemporary database systems that had become increasingly clear during the early 1980s. He won the Turing Award in 2014 for these and other projects,[29] and techniques pioneered in them. The new project, POSTGRES, aimed to add the fewest features needed to completely support data types.[30] These features included the ability to define types and to fully describe relationships тАУ something used widely, but maintained entirely by the user. In POSTGRES, the database understood relationships, and could retrieve information in related tables in a natural way using rules. POSTGRES used many of the ideas of Ingres, but not its code.[31] Starting in 1986, published papers described the basis of the system, and a prototype version was shown at the 1988 ACM SIGMOD Conference. The team released version 1 to a small number of users in June 1989, followed by version 2 with a re-written rules system in June 1990. Version 3, released in 1991, again re-wrote the rules system, and added support for multiple storage managers[32] and an improved query engine. By 1993, the number of users began to overwhelm the project with requests for support and features. After releasing version 4.2[33] on June 30, 1994 тАУ primarily a cleanup тАУ the project ended. Berkeley released POSTGRES under an MIT License variant, which enabled other developers to use the code for any use. At the time, POSTGRES used an Ingres-influenced POSTQUEL query language interpreter, which could be interactively used with a console application named monitor. Postgres95 (1994тАУ1996) [edit] In 1994, Berkeley graduate students Andrew Yu and Jolly Chen replaced the POSTQUEL query language interpreter with one for the SQL query language, creating Postgres95. The monitor console was also replaced by psql. Yu a",
