    "content": "Jump to content Coordinates: 27┬░41тА▓40тА│S 153┬░20тА▓43тА│Eя╗┐ / я╗┐27.69444┬░S 153.34528┬░Eя╗┐ / -27.69444; 153.34528я╗┐ (Logan River (mouth)) From Wikipedia, the free encyclopedia This article is about the river in Queensland, Australia. For the river with the same name in Utah, USA,, see Logan River (Utah). Map all coordinates using OpenStreetMap Download coordinates as KML River in Queensland, Australia Logan The Logan River from Tansey Park, Tanah Merah looking toward Bethania, 2025 Location of the Logan River mouth in Queensland Etymology Captain Patrick Logan Native name Dugulumba (Minjungbal) Location Country Australia State Queensland Region South East Queensland Local government areas Scenic Rim Region, City of Logan, City of Gold Coast Cities Beaudesert, Logan City Physical characteristics Source Scenic Rim тАв location below Mount Ernest тАв coordinates 28┬░19тА▓40тА│S 152┬░42тА▓55тА│Eя╗┐ / я╗┐28.32778┬░S 152.71528┬░Eя╗┐ / -28.32778; 152.71528я╗┐ (Logan River (source)) тАв elevation 380 m (1,250 ft) Mouth Moreton Bay тАв location east of Alberton тАв coordinates 27┬░41тА▓40тА│S 153┬░20тА▓43тА│Eя╗┐ / я╗┐27.69444┬░S 153.34528┬░Eя╗┐ / -27.69444; 153.34528я╗┐ (Logan River (mouth)) тАв elevation 0 m (0 ft) Length 184 km (114 mi) Basin size 3,076 km2 (1,188 sq mi) Basin features Tributaries тАв left Mount Barney Creek, Burnett Creek, Tamrookum Creek, Knapps Creek (Queensland), Sandy Creek (Queensland), Allan Creek, Teviot Brook, Flagstone Creek (Queensland) тАв right Running Creek, Oaky Creek (Queensland), Christmas Creek (Queensland), Albert River National park Mount Barney National Park [1][2][3] The Logan River (Yugambeh: Dugulumba[3]) is a perennial river in the Scenic Rim, Logan and Gold Coast local government areas of the South East region of Queensland, Australia. The 184-kilometre (114 mi)-long river is one of the dominant waterways in South East Queensland that drains the southern ranges of the Scenic Rim and empties into Moreton Bay after navigating the City of Logan, a major suburban centre located south of Brisbane. The catchment is dominated by urban and agricultural land use. Near the river mouth are mangrove forests and a number of aquaculture farms.[4] Course and features [edit] Woodhill, 2016 Logan Bridge below Tamrookum, 1903 Bridge construction on the Logan River, 1930 The river rises below Mount Ernest on the southern slopes of the Scenic Rim, part of the Great Dividing Range and forms in the Mount Barney National Park, near the Queensland тАУ New South Wales border, below Mount Lindesay. The river flows generally north by northeast, joined by eleven minor tributaries, before heading east and eventually emptying into Moreton Bay. Its principal tributaries are the Albert River which joins it just east of Beenleigh; Teviot Brook which begins at Mount Superbus and joins the Logan River at Cedar Pocket; and Burnett Creek which is subverted by the Maroon Dam west of Rathdowney. The river descends 380 metres (1,250 ft) over its 184-kilometre (114 mi) course.[1] The Mount Lindesay Highway via the Maclean Bridge at North Maclean, 2014 Logan River at Carbrook (left) and Alberton (right), 2014 In addition to the Scenic Rim, the Logan and its tributaries drain more than 3,000 square kilometres (1,200 sq mi) including the northern parts of the Border Ranges, the western slopes of the McPherson Range and the eastern slopes of the Main Range. The river\u0027s upper catchment is heavily influenced by the national parks of Tamborine, Mount Barney, Moogerah Peaks, Main Range and the Lamington Plateau, and numerous local government-owned reserves and conservation areas,[5] that comprise part of the Shield Volcano Group of the UNESCO World Heritage Site Gondwana Rainforests of Australia. The river is crossed by the Mount Lindesay Highway near Rathdowney and at North Maclean via Maclean\u0027s Bridge. The river is also crossed by the Pacific Motorway and the Old Pacific Highway south of Loganholme.[1] The Beenleigh railway line crosses the Logan between Loganlea and Bethania. A second rail crossing is planned to accommodate a doubling of rail tracks between the Kuraby and Beenleigh in time for the 2032 Brisbane Olympics.[6] Tidal waters reach to just downstream of the Maclean\u0027s Bridge.[3] Water harvesting [edit] Maroon Dam subverts Burnnett Creek, and supplies water to the Beaudesert Shire. Maroon is managed by SunWater and covers approximately 106 square kilometres (41 sq mi). The Queensland Government has considered several projects to supply water to its Southern Regional Pipeline. The Bromelton off-stream storage facility is under construction on the Logan River, outside Beaudesert, as is the Cedar Grove Weir, near Jimboomba. In 2006 the Queensland Government decided against the construction of a Logan River dam at Tilley\u0027s Bridge in Rathdowney due to mounting public pressure and high road diversion costs. Instead, the Wyaralong Dam was proposed on Teviot Brook near Boonah which will inundate fifteen properties instead of the one hundred properties for the Tilley\u0027s Bridge site. The",
