    "content": "Jump to content Route map: From Wikipedia, the free encyclopedia State highway in California, United States Several terms redirect here. Not to be confused with the Cabrillo Freeway in San Diego. For the congressional district, see California\u0027s 1st congressional district. For other uses, see Pacific Coast Highway (disambiguation) and PCH (disambiguation) State Route 1 SR 1 highlighted in red; with relinquished, future, and unofficial portions in pink Route information Maintained by Caltrans Length 655.845 mi[1] (1,055.480 km) (broken into 5 pieces by U.S. Route 101. Also, portions of SR 1 have been relinquished to or are otherwise maintained by local or other governments, and are not included in the length) Existed 1934тАУpresent Tourist routes Route One, Big Sur Coast Highway and Route One, San Luis Obispo North Coast Byway Portions of the Cabrillo Highway in Santa Barbara and San Mateo Counties[4] Restrictions Special restrictions:[2][3] No flammable or combustible tank vehicles in the Sepulveda Tunnel No trucks with 4 or more axles through Malibu No trucks over 3 short tons (2.7 t) through Lompoc No explosives, flammables or combustibles in the Tom Lantos Tunnels No trucks exceeding 30 feet kingpin to rearmost axle distance from Carmel to San Simeon Major junctions South end I-5 in Dana Point Major intersections SR 133 in Laguna Beach SR 55 in Newport Beach I-10 in Santa Monica US 101 at various locations SR 46 near Cambria SR 68 in Monterey SR 17 in Santa Cruz SR 92 in Half Moon Bay I-280 in Daly City SR 20 near Fort Bragg North end US 101 in Leggett Location Country United States State California Counties Orange, Los Angeles, Ventura, Santa Barbara, San Luis Obispo, Monterey, Santa Cruz, San Mateo, San Francisco, Marin, Sonoma, Mendocino Highway system State highways in California Interstate US State Scenic History PreтАС1964 Unconstructed Deleted Freeways тЖР I-980 тЖТ SR 2 State Route 1 (SR 1) is a major northтАУsouth state highway that runs along most of the Pacific coastline of the U.S. state of California. At 656 miles (1,056 km), it is the longest state route in California, and the second-longest in the US after Montana Highway 200. SR 1 has several portions designated as either Pacific Coast Highway (PCH), Cabrillo Highway, Shoreline Highway, or Coast Highway. Its southern terminus is at Interstate 5 (I-5) near Dana Point in Orange County and its northern terminus is at U.S. Route 101 (US 101) near Leggett in Mendocino County. SR 1 also at times runs concurrently with US 101, most notably through a 54-mile (87 km) stretch in Ventura and Santa Barbara counties, and across the Golden Gate Bridge. The highway is designated as an All-American Road. In addition to providing a scenic route to numerous attractions along the coast, the route also serves as a major thoroughfare in the Greater Los Angeles Area, the San Francisco Bay Area, and several other coastal urban areas. Though some maps and signs mark SR 1 as continuous through the cities of Dana Point, Newport Beach, Santa Monica, and Oxnard, control of segments within those cities were relinquished to those local jurisdictions and are thus no longer officially part of the state highway system. The Golden Gate Bridge is also officially not included in the state highway system because it is maintained locally by the Golden Gate Bridge, Highway and Transportation District. SR 1 was built piecemeal in various stages, with the first section opening in the Big Sur region in the 1930s. However, portions of the route had several names and numbers over the years as more segments opened. It was not until the 1964 state highway renumbering that the entire route was officially designated as SR 1. Although SR 1 is a popular route for its scenery, frequent landslides and erosion along the coast have caused several segments to be either closed for lengthy periods for repairs, or re-routed inland. Route description [edit] Due to its fragmented nature and piecemeal relinquishments, the California Streets and Highways Code defines Route 1 across several subdivisions of section 301 as follows:[5] Route 1 is from: (a) Route 5 south of San Juan Capistrano to Route 101 near El Rio except for the portions of Route 1 relinquished: (1) Within the city limits of the City of Dana Point between the western edge of the San Juan Creek Bridge and Eastline Road at the city limits of the City of Laguna Beach. (2) Within the city limits of the City of Newport Beach between Jamboree Road and Newport Coast Drive. (3) Within the city limits of the City of Santa Monica between the southern city limits and Route 10. (4) Within the city limits of the City of Oxnard between Pleasant Valley Road and Route 101. (b) Route 101 at Emma Wood State Beach, 1.3 miles north of Route 33, to Route 101, 2.8 miles south of the Ventura-Santa Barbara county line at Mobil Pier Undercrossing. (c) Route 101 near Las Cruces to Route 101 in Pismo Beach via the vicinity of Lompoc, Vandenberg Air Force Base, and Guadal",
