    "url": "https://en.wikipedia.org/wiki/The_Game_Award_for_Game_of_the_Year",
    "title": "The Game Award for Game of the Year - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Video game award The Game Award for Game of the Year Larian Studios won Game of the Year for Baldur\u0027s Gate 3 in 2023. Awarded for Best video game of the year Country United States Presented by The Game Awards First award December 5, 2014; 11 years ago (2014-12-05) Most recent winner Clair Obscur: Expedition 33 (2025) Most awards Sony Interactive Entertainment (3) Most nominations Sony Interactive Entertainment (13) Website thegameawards.com The Game Award for Game of the Year is an award presented annually by The Game Awards. It is given to a video game judged to deliver the best experience across creative and technical fields. The award is traditionally accepted by the game\u0027s directors or studio executives. The process begins with over 100 video game publications and websites, which collectively name six games as nominees. After the nominees are selected, the winner is chosen by a combined vote between the jury (90%) and public voting (10%). Since its inception, the award has been given to eleven video games. Publisher Sony Interactive Entertainment has won the award three times and been nominated a record thirteen times, while FromSoftware is the only developer with more than one win. Bethesda Softworks and Capcom are the most nominated companies without a win at four. The most recent winner is Clair Obscur: Expedition 33 by Sandfall Interactive. Process and history [edit] The Game Awards has a voting jury consisting of over 100 video game media and influencer outlets, which have been specifically selected for their work in critically evaluating video games. Each outlet completes an unranked ballot listing its top five choices; games with the most appearances across the ballots are selected as the nominees. The winners are determined between the jury (90%) and public voting (10%).[1] The public vote is held via the official website and social media platforms such as Discord, Facebook, and Twitter;[2][3] in China, fan voting is held via Bilibili.[1] Any game released before a certain date in November prior to the ceremony is eligible for award consideration.[4] As a result, any game released after the cutoff date is eligible in the following year\u0027s ceremony,[1] such as 2018\u0027s Super Smash Bros. Ultimate nominations at the Game Awards 2019;[5] similarly, games released between the ballot due date in early November and the cutoff date in mid-to-late November are often overlooked, such as Star Wars Jedi: Fallen Order in both 2019 and 2020[a] and Demon\u0027s Souls and Marvel\u0027s Spider-Man: Miles Morales in 2020.[4] Early access games available before the cutoff date are eligible, as are live service games regardless of their release year:[1] 2018\u0027s Among Us received several nominations in 2020.[9] Josef Fares presenting Game of the Year at The Game Awards 2022 The Game Award for Game of the Year is given to a video game judged to deliver the best experience across creative and technical fields.[10] It is presented as the final award of the ceremony and is widely considered its most prestigious honor.[11][12][13] Since 2017, the announcement of the winner has been preceded by a medley performance of the scores of each nominee by the Game Awards Orchestra, conducted by Lorne Balfe.[14][15] The category was expanded from five to six nominees in 2018.[16] The award is traditionally accepted by the director of the winning game or an executive from the studio; the first award in 2014 was accepted by Dragon Age: Inquisition executive producer Mark Darrah and BioWare general manager Aaryn Flynn.[17] The Game Awards host and producer Geoff Keighley presented the award for the first four ceremonies.[11][18][19][20] Other presenters include directors of past winnersтАФsuch as 2016 winner Overwatch\u0027s lead director Jeff Kaplan in 2018,[21] 2020 winner The Last of Us Part II\u0027s creative director Neil Druckmann in 2021,[12] 2021 winner It Takes Two\u0027s director Josef Fares in 2022,[22] 2023 winner Baldur\u0027s Gate 3\u0027s director Swen Vincke in 2024,[23] and 2024 winner Astro Bot\u0027s director Nicolas Doucet in 2025[24]тАФand celebrity guests like Vin Diesel and Michelle Rodriguez in 2019,[25] Christopher Nolan in 2020,[26] and Timoth├йe Chalamet in 2023.[27] Winners and nominees [edit] Acceptees of the award Mark Darrah for Dragon Age: Inquisition (2014) Marcin Iwi┼Дski for The Witcher 3: Wild Hunt (2015) Eiji Aonuma and Hidemaro Fujibayashi for The Legend of Zelda: Breath of the Wild (2017) Cory Barlog for God of War (2018) Hidetaka Miyazaki for Sekiro: Shadows Die Twice (2019) and Elden Ring (2022) Neil Druckmann for The Last of Us Part II (2020) Josef Fares for It Takes Two (2021) Swen Vincke for Baldur\u0027s Gate 3 (2023) Nicolas Doucet and Masayuki Yamada for Astro Bot (2024) Guillaume Broche for Clair Obscur: Expedition 33 (2025) Winners are listed first, highlighted in yellow and boldface, and indicated with a double dagger (тАб). Winners and nominees Event Game Developer Publisher Ref. 2014 D",
