    "title": "Uicipeid",
    "content": "Jump to content O Uicipeid F├аilte gu Uicipeid na G├аidhlig тАУ an leabhar-e├▓lais a tha fosgailte do dhuine sam bith! Th├▓isich sinn anns an t-Sultain, 2003, agus tha sinn a-nis ag obair air 16,019 aistidhean anns aтАЩ Gh├аidhlig. Aistidhean Matha agus na Naidheachdan ┬╖ Roinnean-se├▓rsa ┬╖ Na h-Aistidhean Gu L├иir Mu Uicipeid Seo Uicipeid na G├аidhlig. Ann an uicipeidean bidh iomadh neach ag obair ri ch├иile airson leabhar m├▓r-e├▓lais a sgr├мobhadh ann an iomadh c├аnan. Tha 16,019 duilleagan san Uicipeid seo. Tha a h-uile t├и dhiubh saor ri cleachdadh. D├и th\u0027 ann an Uicipeid?: Faic an ro-r├аdh airson barrachd fios mu bhun-st├иidh Uicipeid. Poileasaidhean na h-Uicipeid Stadastaireachd Taic is Cobhair Toiseach-t├▓iseachaidh: duilleagan fiosrachaidh gus sgr├мobhadh ann an Uicipeid ionnsachadh Doras na Coimhearsnachd: l├аrach airson ceistean fhaighneachd Briathrachas: na faclan a chleachdas air Uicipeid Oisean an Luchd-t├▓iseachaidh (Learners\u0027 Corner) Artagail taghta Tutanmhamun: aghaidh ├▓ir Bha Tutankhamun \u0027na ph├аraoh ann an 18mh r├мoghrachas na h-├Иipheit. Bha e aтАЩ riaghladh mu thuaiream eadar 1332 agus 1323 RC r├и linn ann an eachdraidh na h-├Иipheit air a bheil an R├мoghachd ├Щr (no Linn na h-Impireachd ├Щr uaireannan). On a chaidh a lorg, canar R├мgh Tut ris gu tric. Bha ainm t├╣sail, Tutankhaten, aтАЩ ciallachadh \"dealbh be├▓ Aten agus tha Tutankhamun aтАЩ ciallachadh \"dealbh be├▓ Amun\". Ann an dealbh-sgr├мobhadh na h-├Иipheite, sgr├мobhar ainm mar Amen-tut-ankh a ghn├аth an cois gn├аthas an luchd-sgr├мobhaidh a chuireadh ainm d├и aig toiseach abairt mar urram dhan dia. Dh\u0027fhaoidte gur esan an neach air a bheil Nibhurrereya ann an litrichean Amarna agus tha deagh-choltas gur esan R├мgh Rathotis 18mh r├мoghrachas na h-├Иipheit a bha aтАЩ riaghlaidh, a-r├иir an eachdraidhe Manetho, fad naoidh bliadhna, faid a tha a-r├иir an tionndaidh dhen Epitome aig Manetho a sgr├мobh Flavius Josephus. Chaidh tuama Tutankhamun a lorg le Howard Carter agus Iarla Chaernarfon ann an 1922 agus leis gun robh e cha mh├▓r gun mhilleadh, тАЩs e naidheachd mh├▓r a bha ann air feadh an t-saoghail. Dh├╣isg e ├╣idh am measg nan daoine san ├Иipheit ├аrsaidh a-rithist agus tha aghaidh-choimheach Tutankhamun (ri fhaicinn ann an Taigh-tasgaidh na h-├Иipheit) ainmeil air feadh an t-saoghail fhathast. Chaidh buill-ealain ├аs an tuam a thaisbeanadh dhan phoball air feadh an t-saoghail thairis air na bliadhnaichean. Chaidh rannsachadh DNA a dh├иanamh air agus sheall an rannsachadh sa Ghearran 2010 gur esan mac Akhenaten (mumaidh KV55). Bu mhumaidh KV35YL (is chan eil fhios d├и an t-ainm a bha oirre) an d├а chuid piuthair agus bean Akhenaten. A dhтАЩaindeoin sin, tha cinnt gur ise am mumaidh air a bheil aтАЩ Bhaintighearna ├Тg a chaidh a lorg san tuama KV35. A chionn тАЩs gun do chaochail grunnan dhe na daoine a rannsaich tuama Tutankhamun air d├▓igh caran \"annasach\", tha cuid am measg an t-sluaigh dhen bheachd gun do chaochail iad ri linn mallachd nam ph├аraoh. ...leugh an corr San latha an-diugh Maol Chaluim IV \u0027S e 9 an D├╣bhlachd an 343mh latha dhen bhliadhna (344mh ann am bliadhna-leum). 1165 тАУ Chaochail Maol Chaluim IV agus th├▓isich Uilleam I mar R├мgh na h-Alba. 1565 тАУ Chaochail P├аpa Pius IV. 1669 тАУ Chaochail P├аpa Clemens IX. 1868 тАУ Rugadh Fritz Haber, ceimigear Gearmailteach. 1919 тАУ Rugadh William Nunn Lipscomb, ceimigear] ├аs na St├аitean Aonaichte. 1937 тАУ Chaochail Gustaf Dal├йn, e├▓laiche-fiosaig ├аs an t-Suain. An robh fhios agaibh? B\u0027 e b├аrd G├аidhlig agus p├мobaire a bh\u0027 ann an Iain Eairdsidh MacAsgaill no B├аrd Bhe├аrnaraigh (19 Gearran 1898 тАФ 4 ├Тgmhios 1934). B\u0027 ann ├а Be├аrnaraigh na Hearadh a bha e. B\u0027 e mac Dh├▓mhnaill MhicAsgaill agus Anna Mhoireasdan a bh\u0027 ann. Bha piuthar aige, Effie. Bha aon bhr├аthair, Alexander, aige a chaidh ainmeachadh air a chlach-uaighe. Chaidh e do Sgoil Bhe├аrnaraigh eadar 1903 agus 1912. Ann an 1911, bha e agus a phiuthar Effie a\u0027 fuireach c├▓mhla ri p├аrantan am m├аthar, Calum agus Effie Moireasdan aig Croit 3, Borbh. Nuair a dh\u0027fh├аg e sgoil, th├▓isich e ag obair mar ch├мobair agus chuir e seachad bliadhna ag obair do Chalum MacLe├▓id aig Sandhill. Liostaig e sna Cameron Highlanders an uair sin. Anns a\u0027 Chiad Chogadh, b\u0027 e p├мobaire a bh\u0027 ann agus c├▓mhla ri p├мobairean eile she├▓l e an rathad a-steach dhan chath aig Loos, an Fhraing san t-Sultain 1915...leugh an corr M├▓r-E├▓las Saidheansan Teicne├▓lach is Gn├мomhaichte ├Аiteachas - Ailtireachd - Cian-chonaltradh - Coimpiutaireachd - Conaltradh - Croitearachd - Dealan - Eadar-l├мon - E├▓las-leighis - Buain na m├▓na - Gi├╣lan - Iasgach - Innleadaireachd - Teicne├▓las Saidheansan Daonna ├Аrsaidheachd - C├аnan agus C├аnanachas - Corp-e├▓las - Cruinn-e├▓las - Eachdraidh - E├▓las-comainn - E├▓las-inntinn - Feallsanachd - Foghlam - Teagasg Ealain, Dualchas is Cultar Ainmean - B├аrdachd - Ce├▓l - Cultar m├▓r-thaitneach - Dannsa - Ealain - Ealain-l├иirsinneach - Film - Litreachas - Meadhanan - Rosg - Sp├▓rs - Ur-sgeulachdan Saidheansan N├аdarra is Matamataig Beathaichean - Bith-e├▓las - Ceimigeachd - Eige├▓las - E├▓in - Ge├▓las - Matamataig - E├▓las-n├аdair - Reul-e├▓las - D├╣ile",
