    "content": "Jump to content From Wikipedia, the free encyclopedia Central police force in India For militarized police unit in Sudan, see Central Reserve Forces. Law enforcement agency Central Reserve Police Force Emblem of the Central Reserve Police Force Flag of the Central Reserve Police Force Common name CRP force Abbreviation CRPF Motto \"рд╕реЗрд╡рд╛ рдФрд░ рдирд┐рд╖реНрдард╛\" Service and Loyalty Agency overview Formed 27 July 1939; 86 years ago (1939-07-27) (as Crown Representative\u0027s Police) 28 December 1949; 75 years ago (1949-12-28) (as Central Reserve Police Force) Employees 313,678 Active personnel Annual budget тВ╣35,147.17 crore (US$4.2 billion) (2025тАУ26)[1] Jurisdictional structure Operations jurisdiction India Governing body Ministry of Home Affairs Constituting instrument Central Reserve Police Force Act, 1949[2] General nature Gendarmerie Operational structure Headquarters CGO Complex, New Delhi, Delhi Minister responsible Amit Shah, Union Minister of Home Affairs Agency executive Gyanendra Pratap Singh, IPS, Director General Units List Commando Battalion for Resolute Action Rapid Action Force CRPF QAT Special Duty Group VIP Security Group Notables Programmes Operation All Out (J\u0026K) Anti-Naxal Operations (LWE Region) Anniversary Valour Day (9 April) Police Commemoration Day (21 October) Website crpf.gov.in The Central Reserve Police Force (CRPF) is a central armed police force in India, under the Ministry of Home Affairs. The CRPF assists states and Union Territories in maintaining law and order and internal security. It is composed of the Central Reserve Police Force (Regular) and Central Reserve Police Force (Auxiliary). It was established on 27 July 1939 as Crown Representative\u0027s Police with the objective of providing security to the British Crown Representatives in India. The force was later renamed as the Central Reserve Police Force by an Act of Parliament in 1949. The CRPF played a major role in the Parliamentary elections of September 1999.[3] The Central Reserve Police Force (CRPF) is the largest central armed police force in India, comprising 247 battalions and exceeding a total strength of 301,376 personnel, as of 2019.[4] CRPF officers are also deployed in United Nations missions. History [edit] Indian Armed Forces of the Government of India Ministry Ministry of Defence Executive departments Department of Military Affairs Staff Chief of Defence Staff Chief of Integrated Defence Staff Defence Secretary of India Integrated Defence Staff Military departments Department of Defence Department of Military Affairs Department of Defence Production Department of Ex-servicemen Welfare Military services Indian Army Indian Navy Indian Air Force Indian Coast Guard Paramilitary services Paramilitary forces of India Central Armed Police Forces Assam Rifles Border Security Force Central Industrial Security Force Central Reserve Police Force Indo-Tibetan Border Police National Security Guard Sashastra Seema Bal Railway Protection Force Special Frontier Force Special Protection Group Organisations Defence Intelligence Agency Defence Space Agency Defence Cyber Agency DRDO Border Roads Organisation History Military history of India Military history of British India India portal v t e Originally constituted as the Crown Representative Police in 1939, CRP was raised in response to the political unrest and agitations in the then Princely States of India following the Madras Resolution of the All-India Congress Committee in 1936 and the ever-growing desire of the Crown Representative to help the vast majority of the native States preserve law and order as part of imperial policy. After Independence, the force was renamed the Central Reserve Police Force by an Act of Parliament on 28 December 1949. This Act constituted CRPF as an armed force of the Union. Sardar Vallabhbhai Patel, the then Home Minister, visualised a multi-dimensional role for it in tune with the changing needs of a newly independent nation. The force played a significant role during the amalgamation of the princely States into the Indian Union. It helped the Union Government discipline the rebellious princely State of Junagadh and the small principality of Kathiawar in Gujarat which had declined to join the Indian Union. During the early 1950s, the performance of the CRPF detachments in enforcing law and order in Bhuj, the then Patiala and East Punjab States Union and Chambal ravines was appreciated by all quarters. On 21 October 1959, SI Karam Singh and 20 other CRPF personnel were attacked by the Chinese Army at Hot Springs in Ladakh resulting in 10 casualties. The survivors were imprisoned. Since then, 21 October has been observed as Police Commemoration day nationwide, across all states in India.[5] In the late 50s and early 60s, contingents of the CRPF were sent to Kutch, Rajasthan, and Sindh borders to check infiltration and trans-border crimes. They were, subsequently, deployed on the Pakistan border in Jammu and Kashmir following attacks launched by the Pakistani in",
