    "url": "https://en.wikipedia.org/wiki/Constantine_VIII",
    "title": "Constantine VIII - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Byzantine emperor from 962 to 1028 Constantine VIII Emperor and Autocrat of the Romans Contemporary miniature of Constantine VIII, from a Bari Exultet roll[1][2] Byzantine emperor Reign 15 December 1025 тАУ 11 November 1028[n. 1] Coronation 30 March 962 Predecessor Basil II Successor Romanos III Born 960 Died 11/12 November 1028 (aged 67тАУ68) Spouse Helena Issue Eudokia (bg) Zoe Theodora Dynasty Macedonian dynasty Father Romanos II Mother Theophano Constantine VIII (Greek: ╬Ъ╧Й╬╜╧Г╧Д╬▒╬╜╧Дс┐Ц╬╜╬┐╧В, romanized: K┼Нnstant─лnos;[n. 2] 960 тАУ 11/12 November 1028) was de jure Byzantine emperor from 962 until his death. He was the younger son of Emperor Romanos II and Empress Theophano. He was nominal co-emperor from 962, successively with his father; stepfather, Nikephoros II Phokas; uncle, John I Tzimiskes; and brother, Basil II. Basil\u0027s death in 1025 left Constantine as the sole emperor. He occupied the throne for 66 years in total, making him de jure the longest-reigning amongst all Roman emperors since Augustus. Constantine displayed a lifelong lack of interest in politics, statecraft and the military, and during his brief sole reign the government of the Byzantine Empire suffered from mismanagement and neglect. He had no sons and was instead succeeded by Romanos Argyros, husband of his daughter Zoe. Family [edit] Constantine VIII\u0027s father (left) in the Romanos Ivory Constantine was born in 960, two years after his brother Basil. Their parents were Romanos II, the sixth Byzantine emperor of the Macedonian dynasty, and his second wife Theophano, an innkeeper\u0027s daughter described by contemporaries as ambitious and amoral.[3] Aged eight, Constantine was engaged to a daughter of Emperor Boris II of Bulgaria but in the end, he married a Byzantine aristocrat, Helena, daughter of Alypius. Of their three daughters, Eudokia (bg) became a nun after contracting smallpox, Zoe was empress for 22 years, and Theodora reigned for 18 months as the last monarch of the Macedonian line.[4] Life [edit] Gold solidus of Romanos II\u0027s father Constantine VII (left) and Romanos II (right), with a haloed Christ on reverse Histamenon of Nikephoros II (left) and Basil II (right) Histamenon of John Tzimiskes crowned by the Virgin Mary Childhood [edit] Romanos died suddenly in 963. Although Constantine was only three years old, he had already been crowned co-emperor in the preceding year, probably on 30 March.[1] The widowed Theophano installed herself as regent for her sons and stocked the imperial government with supporters, but she faced competition for power with Joseph Bringas, a former advisor of Romanos. Theophano allied with Nikephoros Phokas, a celebrated general and opponent of Bringas. In return for her hand, the childless Nikephoros gave his sacred pledge to protect her children and their interests. Three months after Romanos\u0027 death, supporters of Nikephoros ousted Bringas from power.[5] Nikephoros was crowned emperor in the presence of his nominal co-emperors, Constantine and Basil. A month later he married their mother.[6] Six years later, Nikephoros was murdered at Theophano\u0027s instigation and her lover and co-conspirator John Tzimiskes was acclaimed emperor. Fearing that the empress\u0027 many enemies would damage his political prospects, Tzimiskes turned against Theophano and sent her into exile. Constantine and Basil stayed in the capital and retained their status as co-emperors.[7][8] Adulthood [edit] Tzimiskes died in January 976, when Constantine was sixteen years old, and Basil and Constantine became the new heads of state. Nominally the brothers were equals, but Basil devoted himself to the responsibilities of his office and emerged as the senior Basileus.[9] Constantine had no comparable interest in state business, and never developed any.[10] Apart from participating in a military campaign in 989, which ended without any combat,[11] he occupied his years as Basil\u0027s colleague with private interests. In his youth Constantine was tall, graceful, and athletic, with an excellent speaking voice and a good grasp of rhetoric. He participated in wrestling competitionsтАФwhich he brought back into fashionтАФand in the training and riding of horses. Alongside these active pursuits he was a gourmet and a gourmand,[12] leading in later years to chronic gout which impaired his ability to walk. Emperor [edit] Histamenon of Constantine VIII and Basil II Histamenon of Constantine VIII as sole emperor Basil II had an illustrious reign, pursuing both government reforms and a series of successful wars. He died childless on 15 December 1025 and Constantine, a sixty-five-year-old widower, became the sole emperor as Constantine VIII. During his long term as co-emperor, he had been content to enjoy the privileges of imperial status, without concerning himself with state affairs.[1] Sole rulership did not fundamentally alter this desire \"to pass his life wallowing in extravagant pleasures\".[13] Appointment of Alexi",
