    "content": "Jump to content Coordinates: 38┬░53тА▓26тА│N 77┬░0тА▓32тА│Wя╗┐ / я╗┐38.89056┬░N 77.00889┬░Wя╗┐ / 38.89056; -77.00889 From Wikipedia, the free encyclopedia Upper house of the U.S. Congress United States Senate 119th United States Congress Seal of the U.S. Senate Flag of the U.S. Senate Type Type Upper house of the United States Congress Term limits None History New session started January 3, 2025 (2025-01-03) Leadership President JD Vance (R) since January 20, 2025 President pro tempore Chuck Grassley (R) since January 3, 2025 Majority Leader John Thune (R) since January 3, 2025 Minority Leader Chuck Schumer (D) since January 3, 2025 Majority Whip John Barrasso (R) since January 3, 2025 Minority Whip Dick Durbin (D) since January 3, 2025 Structure Seats 100 Political groups Majority (53) Republican (53) Minority (47) Democratic (45) Independent (2)[a] Length of term 6 years Elections Voting system Plurality voting in 46 states[b] Varies in 4 states Alaska \u0026 Maine: Instant-runoff voting Georgia \u0026 Louisiana:[c] Two-round system Last election November 5, 2024 (34 seats) Next election November 3, 2026 (35 seats) Meeting place Senate Chamber United States Capitol Washington, D.C. United States Website senate.gov Constitution United States Constitution Rules Standing Rules of the United States Senate The United States Senate is a chamber of the bicameral United States Congress; it is the upper house, and the U.S. House of Representatives is the lower house. Together, the Senate and House have the authority under Article One of the U.S. Constitution to make and pass or defeat federal legislation. The Senate has exclusive power to confirm U.S. presidential appointments, to approve or reject treaties, and to convict or exonerate impeachment cases brought by the House. The Senate and the House provide a check and balance on the powers of the executive and judicial branches of government. The composition and powers of the Senate are established by Article One of the U.S. Constitution, which has been in effect since March 4, 1789.[2] Each of the 50 states is represented by two senators who serve staggered six-year terms, for a total of 100 members.[3] From its inception in 1789 until 1913, senators were appointed by the state legislatures of their respective states. Since 1913, however, following ratification of the Seventeenth Amendment senators have been elected by statewide popular vote.[4] The Senate has several powers of advice and consent. These include the approval of treaties, the confirmation of Cabinet secretaries, federal judges (including justices of the Supreme Court), flag officers, regulatory officials, ambassadors, other federal executive officials, and federal uniformed officers. If no candidate receives a majority of electors for vice president, the duty falls to the Senate to elect one of the top two recipients of electors to that office. The Senate conducts trials of officials who have been impeached by the House. The Senate has been considered both a more deliberative[5] and prestigious[6][7][8] body than the House of Representatives due to its longer terms, smaller size, and statewide constituencies, which historically led to a more collegial and less partisan atmosphere.[9] The Senate chamber is located in the north wing of the Capitol Building in Washington, D.C., the nation\u0027s capital. Despite not being a senator, the vice president of the United States serves as ex officio presiding officer and president of the Senate; the vice president may vote only if the Senate is equally divided. In the vice president\u0027s absence, the president pro tempore, who is traditionally the most senior member of the Senate majority party, presides over the Senate, and more often by rule allows a junior senator to take the chair, guided by the parliamentarian. In the early 1920s, the practice of majority and minority parties electing their floor leaders began. The Senate\u0027s legislative and executive business is managed and scheduled by the Senate majority leader, who, on occasion, negotiates some matters with the Senate minority leader. A characteristic practice in the Senate is the filibuster on some matters and its remedy the vote on cloture. History Main article: History of the United States Senate The drafters of the Constitution debated more about how to award representation in the Senate than about any other part of the Constitution.[10] While bicameralism and the idea of a proportional[d] \"people\u0027s house\" were widely popular, discussions about Senate representation proved contentious. In the end, some small statesтАФunwilling to give up their equal power with larger states under the Articles of ConfederationтАФthreatened to secede[11] in 1787, and won the day by a vote of 5тАУ4 in what became known as the Connecticut Compromise. The Connecticut Compromise provided, among other things, that each stateтАФregardless of populationтАФwould be represented by two senators.[12] First convened in 1789, the Senate of the United States was formed on t",
