    "content": "Jump to content Coordinates: 27┬░59тА▓15тА│S 152┬░59тА▓43тА│Eя╗┐ / я╗┐27.98750┬░S 152.99528┬░Eя╗┐ / -27.98750; 152.99528 From Wikipedia, the free encyclopedia This article is about local government. For the geographic features of this area, see Scenic Rim. Map all coordinates in \"Category:Scenic Rim Region\" using OpenStreetMap Download coordinates as KML Local government area in Queensland, Australia Local government area in Queensland, Australia Scenic Rim Region Local government area Location within South East Queensland Country Australia State Queensland Region West Moreton Established 2008 Council seat Beaudesert Government тАв Mayor Tom Sharp тАв State electorate Scenic Rim тАв Federal division Wright Area [2] тАв Total 4,243 km2 (1,638 sq mi) Population тАв Total 42,984 (2021 census)[1] тАв Density 10.1306/km2 (26.238/sq mi) Website Scenic Rim Region LGAs around Scenic Rim Region Lockyer Valley Ipswich Logan Southern Downs Scenic Rim Region Gold Coast Southern Downs Kyogle (NSW) Tweed (NSW) The Scenic Rim Region is a local government area (LGA) in the West Moreton region of South East Queensland, Australia. Established in 2008, it was preceded by several previous local government areas with histories extending back to the early 1900s and beyond. The main town of the region is Beaudesert. It has an estimated operating budget of A$33 million. In the 2021 census, the Scenic Rim Region had a population of 42,984 people.[1] History [edit] Prior to 2008, the new Scenic Rim Region was an entire area of three previous and distinct local government areas: the Shire of Boonah; the southern part of the Shire of Beaudesert; and the Harrisville and Peak Crossing areas from the City of Ipswich. Beaudesert Shire Tramway, 1903 A bullock team at Kalbar, 1915 Timber yards at Canungra, 1939 In July 2007, the Local Government Reform Commission released its report and recommended that the areas amalgamate. It identified a rural community of interest as well as ecotourism potential from the Scenic Rim, a group of mountain ranges forming part of the Great Dividing Range, and recommended the transfer of the entire urban growth corridor previously within Beaudesert to Logan City. Along with Lockyer Valley and Somerset, it was expected to provide a rural hinterland for urban South East Queensland. The arrangement was Boonah\u0027s second preference (its first was simply absorbing the rural areas of Ipswich) while Beaudesert opposed splitting or amalgamation.[3] The legislation passed to effect the merger on 10 August 2007. A Local Transition Committee made up of staff and councillors of the dissolving entities was formed to manage the process. On 15 March 2008, the Shires formally ceased to exist, and elections were held on the same day to elect councillors and a mayor to the Regional Council. Geography [edit] Mount Lindesay from Palen Creek Mount Maroon, 2009 The region is mostly rural, with Beaudesert and Boonah the main towns. It lies within the catchment areas of the Bremer River, the Logan River/Albert River and the Coomera River/Nerang River. The centre of the area is dominated by the Flinders Peak Group and broad sweep of mountainous terrain forming a southern boundary with the local government area on Queensland\u0027s southern border with New South Wales. Many high-altitude areas are covered by forests and protected in national parks (including World Heritage listings) at Tamborine Mountain, McPherson Range, Main Range National Park, Mount Barney National Park and landforms including Cunninghams Gap and Fassifern Valley. South East Queensland\u0027s highest mountain is Mount Barney, reaching 1,356 metres (4,449 ft) above sea level. Wyaralong Dam is the region\u0027s newest reservoir. In the south east of the local government area is the Lamington National Park. It includes villages such as Canungra, Kooralbyn, Rathdowney, Beechmont and Harrisville. The peak at Mount French, part of Moogerah Peaks National Park is noted for its traditional rock climbing and does not have bolted climbing routes. The peak also boasts a \u002732\u0027 rated climb (one of the hardest in the world) which attracts international rock climbing visitors to the area. The area of Boonah is fairly flat with large areas of very productive soils for the growing of vegetables and other crops. Beechmont and O\u0027Reillys are mountainous areas overlooking the Gold Coast hinterland. These areas attract visitors for camping, bushwalking and bird watching. Council [edit] The council is split into six wards (divisions), each returning one councillor, along with a directly-elected mayor. Current composition [edit] The current council, elected in 2024, is: Ward Councillor Party Mayor Tom Sharp Independent Division 1 Amanda Hay Independent Division 2 Kerri Cryer Independent Division 3 Stephen Moriarty Independent Division 4 Jennifer Sanders Independent Division 5 Marshall Chalk Independent Division 6 Duncan McInnes Independent Mayors [edit] John Brent was the region\u0027s first mayor. He was first elected as a councillor in t",
