    "content": "Jump to content From Wikipedia, the free encyclopedia Darts world championship Darts tournament WDF World Darts Championship Tournament information Venue Lakeside Country Club Location Frimley Green, Surrey, England Established 2022 Organisation(s) World Darts Federation (WDF) Format Sets Prize fund ┬г221,000 (total) Month(s) Played NovemberтАУDecember Current champion(s) Jimmy van Schie (open)[a] Deta Hedman (women) Mitchell Lawrie (youth)[a] Zehra Gemi (girls) The WDF World Darts Championship is an annual world championship in the sport of darts organised by the World Darts Federation (WDF). Since 2024, the championship has run from late November to early December. The event has been held at the Lakeside Country Club in Frimley Green, Surrey, England, every year since the inaugural edition in 2022. Following the collapse of the British Darts Organisation (BDO) in 2020, which hosted the BDO World Darts Championship at Lakeside from 1986 to 2019 and held the tournament\u0027s final edition in 2020, the WDF World Championship was established as the successor.[2] It is one of two World Championships in darts, along with the PDC World Darts Championship. Jimmy van Schie is the reigning WDF world champion, having defeated Mitchell Lawrie 6тАУ3 in the 2025 final. Deta Hedman is the reigning women\u0027s world champion, Mitchell Lawrie is the reigning youth world champion, and Zehra Gemi is the reigning girls\u0027 world champion. Beau Greaves is the only player to win multiple WDF World Championships, winning the first three editions of the women\u0027s tournament. History [edit] The BDO World Darts Championship was a world championship in the sport of darts organised by the British Darts Organisation (BDO). The tournament was first held in 1978 and was the only form of the World Professional Darts Championship until the 1993 split in darts, when top players broke away from the BDO to set up the rival World Darts Council (WDC), now the Professional Darts Corporation (PDC), which began hosting its own World Championship.[3] The Lakeside Country Club in Frimley Green, Surrey, England, served as the host venue for the BDO tournament from 1986 to 2019, with the event being moved to the Indigo at The O2 for the 2020 event.[4] The 2020 event ended up being the last edition of the BDO World Championship, as the organisation went into liquidation in September 2020 following a series of financial issues relating to poor ticket sales and prize money.[5][6] Following the collapse of the BDO, the World Darts Federation (WDF), a darts tournament organiser and governing body,[7][8] announced its intention to launch its own World Championship.[9] Returning to the Lakeside Country Club and initially scheduled to take place in January 2022, the inaugural edition of the WDF World Championship took place in April 2022 after being postponed due to concerns surrounding the COVID-19 pandemic.[10][11] The event saw the introduction of a separate girls\u0027 tournament, which joined the men\u0027s tournament, women\u0027s tournament and boys\u0027 tournament in the schedule.[12] The PDC granted permission for its new Tour Card holders to compete at the WDF World Championship if they qualified for the tournament before the event\u0027s postponement.[13] At the event, Richard Veenstra produced the highest three-dart average in Lakeside history (104.91) in his 3тАУ0 third-round victory over Luke Littler, breaking an 18-year record held by Raymond van Barneveld.[14] The WDF moved the World Championship to December for the 2023 edition, taking place right before the 2024 PDC World Championship. As a result, the PDC ruled against allowing players to compete in both events.[15] This rule prevented three-time women\u0027s world champion Beau Greaves from competing in the PDC World Championship, rejecting her place at the tournament in order to defend her world title at Lakeside in 2023 and 2024,[16] before she made a full switch to the PDC ahead of the 2026 PDC World Championship.[17] Since 2024, the WDF World Championship has run from late November to early December.[18] Tournament finals [edit] Open [edit] Jimmy van Schie, the reigning WDF world champion Neil Duff was the first WDF world champion, defeating Thibault Tricole in a deciding set in the 2022 final.[19] Andy Baetens won the tournament in 2023 by beating Chris Landman 6тАУ1.[20] In 2024, 70-year-old Paul Lim, who hit the first world championship nine-dart finish at the 1990 BDO World Darts Championship, reached the final of the tournament, becoming the oldest player to reach a darts world championship final. He missed out on the title, losing 6тАУ3 to Shane McGuirk.[21] In contrast, 15-year-old Mitchell Lawrie reached the final in 2025 to become the tournament\u0027s first teenage finalist. He lost to Jimmy van Schie by the same scoreline.[22] Duff, Baetens and McGuirk were the first senior world champions from Northern Ireland, Belgium and the Republic of Ireland respectively.[23][24][25] Year Champion (average in final)[b] Score Runner-up (aver",
