    "content": "Jump to content From Wikipedia, the free encyclopedia American football player and broadcaster (born 1967) Scott Zolak Zolak in 2009 No. 16, 14 Position Quarterback Personal information Born (1967-12-13) December 13, 1967 (age 58) Pittsburgh, Pennsylvania, U.S. Height 6 ft 5 in (1.96 m) Weight 230 lb (104 kg) Career information High school Ringgold (Monongahela, Pennsylvania) College Maryland (1986-1990) NFL draft 1991: 4th round, 85th overall pick Career history New England Patriots (1991тАУ1998) New York Jets (1999)* Miami Dolphins (1999) * Offseason and/or practice squad member only Career NFL statistics TDтАУINT 8тАУ7 Passing yards 1,314 Passer rating 64.8 Stats at Pro Football Reference Scott David Zolak (born December 13, 1967) is an American broadcaster and former professional football player. He played quarterback in the National Football League (NFL) for nine seasons, primarily with the New England Patriots. Over the course of his career, he played in 55 games, with 7 starts, for the Patriots and Miami Dolphins, completed 124 of 248 passes for 1,314 yards, threw eight touchdowns and seven interceptions, and finished his career with a passer rating of 64.8. A graduate of Ringgold High School and the University of Maryland, Zolak was selected 84th in the 1991 NFL draft by the New England Patriots. He did not play in 1991, but started four games in 1992 and had his most productive season statistically. When Drew Bledsoe was drafted in 1993, Zolak became his backup for the next six seasons. He appeared as a replacement for Bledsoe when he was hurt, but only started three games during this time. He was released at the end of the 1998 season, and signed with the New York Jets and Miami Dolphins in 1999, playing in one game for Miami before retiring. After his retirement, he became a sportscaster and football analyst in the New England area. Early life [edit] High school [edit] Zolak was born on December 13, 1967, in Pittsburgh, Pennsylvania. As a child, was the waterboy for the football team at Ringgold High School in Monongahela, Pennsylvania, where his father, Paul, worked as head coach and athletic director.[1][2][3] Future NFL quarterback Joe Montana played for Ringgold during this time and gave Zolak a football, which he later rubbed for good luck before every game.[1] When Zolak attended Ringgold High School himself, he was the team\u0027s starting quarterback and punter, and lettered four times.[2] Zolak also played on the Ringgold basketball team as a forward, and was a four-time letterman in that sport as well.[2] As a result of his football performance, he was invited to participate in the Big 33 Football Classic, which featured the top high school football players in Pennsylvania.[4] College [edit] After graduating from high school, Zolak played college football at the University of Maryland. He sat out his freshman year, and became the third-string quarterback for the Terrapins behind Dan Henning and Neil O\u0027Donnell after two quarterbacks transferred.[5] By the end of his sophomore season, Zolak was challenging O\u0027Donnell for the starting job after Henning graduated.[6] As his junior year began, in the summer of 1988, offensive coordinator Bob Valesente said that Zolak was making tremendous strides as a quarterback, but O\u0027Donnell was the starting quarterback that year.[7] Zolak\u0027s first collegiate appearance came against West Virginia. He completed four of six passes for 28 yards, but had an interception returned for a touchdown by Bo Orlando in a 55тАУ24 loss.[8] He appeared in four games for Maryland that season.[2] Zolak was again the backup behind O\u0027Donnell in 1989. He played in eight games, completing 33 of 69 passes for 407 yards and two touchdowns.[2] In 1990, after O\u0027Donnell graduated and began his NFL career, Zolak became the starter for Maryland, and head coach Joe Krivak had high hopes for him heading into the season.[9] In his first start as a senior, Zolak completed a school-record 28 passes in 46 attempts for 303 yards and two touchdowns, including a 51-yard pass to Gene Thomas with 61 seconds left that gave Maryland the win against Virginia Tech, 20тАУ13.[10] The following week, he once more featured in a dramatic conclusion, throwing a 59-yard touchdown pass to Gene Thomas with 2:27 left to beat 25th-ranked West Virginia, 14тАУ10.[11] However, he was struggling in other aspects of his game. In an October game against Georgia Tech, Zolak was sacked 10 times. In four games, he had been sacked 23 times and had 12 passes intercepted.[12] By the end of the season, as Maryland was preparing to face Louisiana Tech in the 1990 Independence Bowl, he had thrown 225 completed passes in 418 attempts for 2,589 yards and 10 touchdowns.[13] The teams tied, 34тАУ34, in Zolak\u0027s final collegiate appearance. At the time of his graduation, he ranked fifth in school history with 270 pass completions, seventh with 3,124 career passing yards, and second with 2,589 passing yards in a season. He was also named Atlantic Coa",
