    "content": "Jump to content From Wikipedia, the free encyclopedia Community Q\u0026A hub for new editors Shortcuts Help:FRIENDLYHelp:FRIENDLY WP:TEAWP:TEA WP:THWP:TH Welcome to the Teahouse! Your go-to place for friendly help with using and editing Wikipedia. Ask a question Question forumMeet your hostsArticles to improveBecome a host Can\u0027t edit this page? Just use this link to ask for help on your talk page; a volunteer will visit you there shortly! New to Wikipedia? See our tutorial for new editors or introduction to contributing page. Note: Newer questions appear at the bottom of the Teahouse. Completed questions are archived within 2тАУ3 days. Help Wikipedia To read the newest questions, skip to bottom About the Teahouse Most recent archives 1255, 1256, 1257, 1258, 1259, 1260, 1261, 1262, 1263, 1264, 1265, 1266, 1267, 1268, 1269, 1270, 1271, 1272, 1273, 1274 Assistance for new editors unable to post here [edit] This section is pinned and will not be automatically archived. The Teahouse is frequently semi-protected, meaning the Teahouse pages cannot be edited by unregistered users, as well as accounts that are not confirmed or autoconfirmed (accounts that are at least 4 days old with at least 10 edits on English Wikipedia). However, you can still get direct assistance on your talk page. Use this link to ask for help; a volunteer will reply to you there shortly. There are currently 1 user(s) asking for help via the {{Help me}} template User talk:AlmostTuesday Should we revive the WP:Bowling Project [edit] Wikipedia:WikiProject Bowling add Approve or Oppose with your Reason down below YourLocalZakkFromSomewhere (talk) 14:11, 3 December 2025 (UTC)[reply] Hello, @YourLocalZakkFromSomewhere. Like (probably) 95% of the people here, I have no interest, and don\u0027t care either way. But I will point out that you can \"revive\" till you\u0027re blue in the fact, but if you don\u0027t have several people actively interested, and willing to spend time working on the project, \"reviving\" it will be an empty gesture and a waste of time. ColinFine (talk) 15:09, 3 December 2025 (UTC)[reply] I mean arent most of them dead? (inactive) YourLocalZakkFromSomewhere (talk) 19:56, 3 December 2025 (UTC)[reply] In my opinion, the best way to really promote the topic of bowling on Wikipedia would be to look for articles on that topic that need improvement, and fix them up. I think the best project for bowling is, when you get done editing, go bowling! :) TooManyFingers (talk) 16:46, 3 December 2025 (UTC)[reply] I mean I want to revive it because I do leagues for my school and a league that they have YourLocalZakkFromSomewhere (talk) 19:55, 3 December 2025 (UTC)[reply] You know your school bowling league is never getting an article on Wikipedia, right? TooManyFingers (talk) 20:29, 3 December 2025 (UTC)[reply] Yes. YourLocalZakkFromSomewhere (talk) 13:47, 4 December 2025 (UTC)[reply] Then ... I\u0027m guessing you only mentioned them because the whole thing has inspired you to try to improve Wikipedia\u0027s coverage of bowling. That\u0027s great! I hope you find lots of good sources of bowling information to improve articles or write new ones. TooManyFingers (talk) 00:46, 5 December 2025 (UTC)[reply] could it be like for PBA Players (Ex: E.J. Tackett Kyle Troup) YourLocalZakkFromSomewhere (talk) 13:50, 4 December 2025 (UTC)[reply] I don\u0027t think I understood your question. Could what be like for PBA players? TooManyFingers (talk) 00:48, 5 December 2025 (UTC)[reply] Add like a daily article about bowling in the WP:Bowling (for ex. ej tackett or 9 pin no tap bowling) YourLocalZakkFromSomewhere (talk) 14:11, 5 December 2025 (UTC)[reply] like what they do on the main page YourLocalZakkFromSomewhere (talk) 14:12, 5 December 2025 (UTC)[reply] Oh I get it! I don\u0027t know the answer, but someone somewhere will know. :) Sorry I wasn\u0027t more helpful. One thing: I wouldn\u0027t try changing it daily. The main page has enough people to keep working on it, and they always have tons of possible choices for what to put up next. Bowling doesn\u0027t have those advantages. TooManyFingers (talk) 18:04, 5 December 2025 (UTC)[reply] Like I would do it. YourLocalZakkFromSomewhere (talk) 18:05, 5 December 2025 (UTC)[reply] Per WP:BOLD, you could just start doing it. Then if anyone objects, pause what you\u0027re doing and discuss it with them until you and others reach consensus. -- Avocado (talk) 16:54, 10 December 2025 (UTC)[reply] alright (ZakkЁЯШО) 16:10, 12 December 2025 (UTC)[reply] As with any moribund Wikiproject, there are a number of things you can do to revive it: Post a query on the talkpage, provided that query is along the lines of \"please can anyone here advise if -------- is a typo or some specific bowls jargon\" and not \"would anyone watching like to revive this project?\" Check the timeline of the subject of the project and look for a notable anniversary. If one is coming up in the next couple of years, try to get it in Wikipedia:Selected_anniversaries#Steps_for_suggesting_new_listings. If the article isn\u0027",
