    "content": "Jump to content From Wikipedia, the free encyclopedia Singaporean singer and actress (1931тАУ2024) In this Malay name, there is no surname or family name. The name Aman is a patronymic, and the person should be referred to by their given name, Asiah. The word \"bin\"/\"ibn\" or \"binti\"/\"binte\" means \u0027son of\u0027 or \u0027daughter of\u0027, respectively. Asiah Aman Asiah in 2016 Born Asiah binti Aman 29 November 1931[a] Singapore, Straits Settlements Died 30 July 2024(2024-07-30) (aged 92) Changi General Hospital, Singapore Other names Nona Asiah Occupations Singer actress Years active 1940sтАУ1975 Spouse Ismail Kassim (ms) (m. 1955; died 1994) Children 5; including Iskandar Relatives Imam Shah (grandson) Awards Cultural Medallion, 2016 Singapore Women\u0027s Hall of Fame, 2022 Asiah binti Aman (29 November 1931[a] тАУ 30 July 2024), known professionally as Nona Asiah, was a Singaporean singer and actress. Born in Singapore under British rule, she was the oldest of six children to a Malay mother and Indonesian father. Her career began in the 1940s when she worked as a singer during the Japanese occupation, singing Japanese songs for soldiers in camps in Seletar and Tengah. Following the end of the occupation, she began working for Radio Malaya and sang Malay-language songs with the radio\u0027s band. Her singing skills were recognised by British recording company His Master\u0027s Voice, which led to her signing a contract with them and producing a Malay cover of \"B├йsame Mucho\" that became popular. She also developed her stage name Nona Asiah with her mentor Zubir Said around this time. Asiah\u0027s first film role was in 1948 when she sang on Malay film Chinta alongside P. Ramlee, both of them making their debut in this film. She went on to perform throughout the 1950s and 1960s before retiring in 1975, subsequently teaching singing and acting from the 1970s to 1980s. She was awarded the Cultural Medallion in 2016 and inducted into the Singapore Women\u0027s Hall of Fame in 2022 for her contributions to music. Her son, Iskandar Ismail, was also a Cultural Medallion recipient who predeceased her in 2014. Asiah died in 2024 following heart complications at the Changi General Hospital; she was buried in a cemetery in Lim Chu Kang. Early life and career [edit] Asiah was born on 29 November 1931 in Singapore, then a part of the Straits Settlements, to Hajar Rahmah, a bangsawan singer, and Aman Ahmad, a musician. The oldest of six siblings, she lived in a shophouse unit at Allanby Road. Asiah recalled that \"performers and football players from the nearby Jalan Besar Stadium would gather at our place.\" Her mother Hajar was a Malay Singaporean who worked as a prima donna for the Dean Tijah opera troupe.[4] Her father Aman came from Pontianak, Indonesia, and worked as a painter and musician; he painted the backdrops and sets for their troupe. Asiah\u0027s parents arrived in Singapore after being contracted to work at New World Amusement Park. She studied at a Malay school in Kampong Glam and a secondary school in Rochor. In her youth, Asiah joined school choirs due to an interest in singing.[3]:тАК1тАУ4тАК[5] Asiah learnt English at night private schools.[3]:тАК8тАК Despite only studying up to Standard 7,[6] Asiah was a part of a wave of female performers who managed to attend primary and secondary school.[5] During the Japanese occupation, Asiah developed a love interest with a Japanese teacher, Watanabe Makoto, who was impressed by their bangsawan performances. He subsequently invited Asiah and Hajar to attend Japanese classes so they could learn Japanese and perform bangsawan in Japanese. Asiah and Hajar learnt katakana at Cathay Building, with soldiers sending them to different camps in Seletar and Tengah to perform for Japanese troops. After these shows, they received payment in cigarettes and food before being sent back to Cathay Building.[6] This was Asiah\u0027s first experience performing and singing.[6][7] Singing and acting career [edit] After the surrender of Japan, Asiah got her first paying job as a singer for a band called Tiga Serumpun (lit.тАЙ\u0027Three Get-Together\u0027) at Radio Malaya in 1946. While working there, she taught Malay through songs when the station started broadcasting in schools. Asiah was soon offered a recording contract by British record label His Master\u0027s Voice (HMV), and recorded her first song, a Malay cover of \"B├йsame Mucho\", in 1949 on the Path├й label,[b] which became an instant success. Asiah recorded twenty more songs for HMV by the time she turned nineteen.[6][7] Asiah, who recorded these songs with Tiga Serumpun, was often paid S$45.00 a song with additional royalties. This was considered a large sum at the time, and an executive of HMV had \"taught [them] how to open bank accounts\" as \"he was worried [they] would spend all [their] money.\"[4] This was also when she developed her stage name, Nona Asiah, which was suggested by her mentor Zubir Said. Zubir, whose songs Asiah also covered multiple songs of, was a friend of Asiah\u0027s mother, which was how ",
