    "content": "Spring til indhold Fra Wikipedia, den frie encyklop├жdi Velkommen til Wikipedia, den frie encyklop├жdi som alle kan redigere. Astronomi Botanik Cykling Film Geografi Historie Musik Kristendom Kvinder Zoologi Flere portaler... Der findes nu over 60 millioner artikler p├е Wikipedia, hvoraf 311.811 er p├е dansk. Skribentforside тАв Hj├жlp тАв AтАУ├Е тАв Projekter тАв Bekendtg├╕relser тАв Wikipedia Mobil тАв Kontakt Wikipedia Ugens artikel Rasmus Seebach (f├╕dt 1980) er en dansk sanger, sangskriver og producer. Han solodebuterede med hitsinglen \"Engel\" i 2009 efter at have fungeret som sangskriver for andre musikere i mere end ti ├еr. I september fulgte hans selvbetitlede debutalbum, der blev en stor succes med over 240.000 solgte eksemplarer, samt rekorden for flest uger p├е toppen af album-hitlisten. Med udsendelsen af sit andet album, Mer\u0027 end k├жrlighed, i oktober 2011 blev Seebach den hurtigst s├жlgende musiker i Danmark nogensinde, da albummet solgte over 42.000 eksemplarer p├е ├йn uge. Samlet set har Seebach solgt over 600.000 eksemplarer af sine to f├╕rste album sammen med live-albummet Rasmus Seebach Live (2012). Han har siden udgivet albummene Ingen kan love dig i morgen (2013) og Verden kan vente (2015). Seebachs musik er blevet udgivet i Sverige, Norge og Tyskland. I Sverige og Norge har han haft succes med top fem-hittet \"Natteravn\", der solgte henholdsvis guld og tredobbelt platin. I Danmark har Seebach, sammen med storebroren Nicolai, haft stor succes som sangskriver med st├╕ttesangen \"Hvor sm├е vi er\" (2005), der solgte 13 gange platin. Seebachs succes som solomusiker er blevet tilskrevet sangenes enkle, banale tekster om \"k├жrlighed og byture, der i sin lyrik oftest er tale- eller SMS-sprog\", samt \"at hans livshistorie indeholder ingredienserne til en dansk pop-fort├жlling af de mere barske\", med henvisning til at Seebach er s├╕n af den popul├жre dansktopsanger Tommy Seebach, der d├╕de af et hjertestop i 2003 efter et ├еrelangt alkoholmisbrug. (L├жs mere..) Seneste tre uger: Lars von Trier тАФ Juletraditioner тАФ Jul Mere om Ugens artikel тАв Arkiv Dagens skandinaviske artikel Gjesv├еl eller Gisvold er en g├еrd p├е Fannrem, omtrent 50 km s├╕rvest for Trondheim. G├еrden har lang historie. G├еrdsanlegget ligger omkring 150 meter ├╕st for Orkdal kirke, p├е samme plat├е som denne og presteg├еrden, og det kan ha v├жrt bebyggelse og bosetning p├е plat├еet langt tilbake i f├╕rkristen tid. Gjesv├еl har tilh├╕rt erkebispesetet i Nidaros. Etter reformasjonen ble g├еrden krongods, og fra 1600-tallet har den blant annet v├жrt fogd-, kapellan- og lensmannsg├еrd. Sagbruksdrift har i perioder, fra 1600-tallet og fremover, v├жrt viktig for Gjesv├еl. Hovedbygningen fra 1773, med det spesielle seteritaket, er fredet. Bygningen har mange trekk til felles med trepaleene og lystg├еrdene i Trondheim, og det er mulig at b├еde arkitekt og bygningsarbeidere ble hentet derfra. тЦ║ Les mer her. Dagens skandinaviske artikel er fra norsk (bokm├еl) Wikipedia Mere om Dagens skandinaviske artikel тАв Skanwiki Fremh├жvede artikler Fremragende artikler De nyeste fremragende artikler Casper \u0026 Mandrilaftalen IC4 Eurovision Song Contest 2014 Middelaldercentret Gode artikler De nyeste gode artikler Linje 250S Ove Sprog├╕e Geoteknik Shu-bi-dua Lovende artikler De nyeste lovende artikler George H.W. Bush General Motors General Dynamics F-16 Fighting Falcon Geelong Rediger тАв Mere fremh├жvet indhold Kategorier Naturvidenskab Naturvidenskab Astronomi Biologi Datalogi Fysik Geografi Geologi Kemi Logik L├жgevidenskab Matematik Humaniora Humaniora og samfundsvidenskab Antropologi Arkitektur Filosofi Historie Jura Kommunikation Psykologi P├жdagogik Sociologi Sprogforskning Statskundskab Teologi ├Шkonomi Teknik Teknik Elektronik Energi Industri Jordbrug Mekanik Milit├жr Robotter Sundhedsv├жsen Transport Kultur Kultur Dans Film Hobby Kunst Litteratur Mad og drikke Mode Musik Mytologi Personer Politik Religion Sport Teater Traditioner Turisme Underholdning Flere kategorier Aktuelle begivenheder Danmarks EU-formandskab тАв Ruslands invasion af Ukraine Norges kvindelandshold (billedet) vinder VM i h├еndbold 2025. Den h├╕jreorienterede Jos├й Antonio Kast vinder pr├жsidentvalget i Chile. 16 mennesker meldes dr├жbt ved et masseskyderi p├е Bondi Beach i Australien. Andrej Babi┼б udn├жvnes til premierminister i Tjekkiet. Et folketingsflertal aftaler at indf├╕re en medieombudsmand i Danmark. Rediger тАв Flere aktuelle begivenheder I dag Den 15. december: Zamenhofdag (esperanto: Zamenhofa Tago) mindedag for esperantoskaberen Ludwik Lejzer Zamenhof. 1891 - James Naismith introducerer den f├╕rste version af basketball (billedet) med 13 regler, en ferskenkurv s├╕mmet fast i hver ende af sin skoles gymnastikhal og to hold med 9 spillere p├е hver. 1961 - I Jerusalem d├╕mmes Adolf Eichmann til d├╕den efter at v├жre blevet fundet skyldig i 15 anklager bl.a. om forbrydelser mod menneskeheden og forbrydelser mod det j├╕diske folk. 1995 - EF-domstolen afsiger den s├еkaldte Bosmandom, der forhindrer fodboldklubber i at kr├жve vederlag for spillere, hvis kontrakte",
