    "url": "https://species.wikimedia.org/wiki/",
    "title": "Wikispecies, free species directory",
    "content": "Jump to content From Wikispecies Welcome to Wikispecies The free species directory that anyone can edit. It covers Animalia, Plantae, Fungi, Bacteria, Archaea, Protista and all other forms of life. So far we have 931,936 entries. Wikispecies is free, because life is in the public domain! You can also check us out on ЁЭХП (formerly Twitter): @Wikispecies or use the Android app sponsored by Wikimedia. Taxon Navigation Superregnum Archaea Superregnum Bacteria Superregnum Eukaryota Regnum Protista Regnum Fungi Regnum Plantae Regnum Animalia Virus (classification still unclear) Macropus giganteus Capparis spinosa Sympetrum flaveolum Amphiprion ocellaris Purnella albifrons Fomitopsis pinicola Lilioceris lilii Explore Wikispecies HELP Section тАУ Detailed information on creating pages. Taxonomy тАУ Information on the Linnaean classification of species. Village Pump тАУ Discuss the project. Done and To Do тАУ See references to very detailed areas and defined future targets Wikispecies FAQ тАУ Check replies to common concerns. Image Guidelines тАУ Our recommendation on where to upload illustrations Wikispecies PR тАУ Help us by spreading the word of Wikispecies Collaboration with ZooKeys A collaboration between Wikispecies and ZooKeys has been announced. PhytoKeys also joined the collaboration in November 2010. Images of species from ZooKeys and PhytoKeys will be uploaded to Wikimedia Commons and used in Wikispecies. Distinguished author Mary Agnes Chase 1869тАУ1963. Standard IPNI form: Chase Mary Agnes Chase, n├йe Merrill, was an American botanist who worked at the U.S. Department of Agriculture and the Smithsonian Institution. She is considered one of the world\u0027s outstanding agrostologists and is known for her work on the study of grasses, and also for her work as a suffragist. Chase was born in Iroquois County, Illinois and held no formal education beyond grammar school. That aside, she made significant contributions to the field of botany, authored over 70 scientific publications, and was conferred with an honorary doctorate in science from the University of Illinois. She specialized in the study of grasses and conducted extensive field work in North- as well as and South America. Her Smithsonian Field Books collection from 1897 to 1959 is archived in the Smithsonian Institution Archives. In 1901, Chase became a botanical assistant at the Field Museum of Natural History under Charles Frederick Millspaugh, where her work was featured in two museum publications: Plantae Utowanae (1900) and Plantae Yucatanae (1904). Two years later, Chase joined the U.S. Department of Agriculture (USDA) as a botanical illustrator and eventually became a scientific assistant in systematic agrostology (1907), assistant botanist (1923), and associate botanist (1925), all under Albert Spear Hitchcock. Chase worked with Hitchcock for almost twenty years, collaborating closely and also publishing, for instance The North American Species of Panicum (1910). Following Hitchcock\u0027s death in 1936, Chase succeeded him to become senior botanist in charge of systematic agrostology and custodian of the Section of Grasses, Division of Plants at the United States National Museum (USNM). Chase retired from the USDA in 1939, but continued her work as custodian of the USNM grass herbarium until her death in 1963. She was an Honorary Fellow of the Smithsonian Institution (1959) and Fellow of the Linnean Society of London (1961). Agnesia is named in her honour (a monotypic genus of herbaceous South American bamboo in the grass family). Chase experienced discrimination based on her gender in the scientific field, for example, being excluded from expeditions to Panama in 1911 and 1912 because the expedition\u0027s benefactors feared the presence of women researchers would distract men. During World War I, Chase marched with Alice Paul and was jailed several times for her activities. In 1918, she was arrested at the Silent Sentinels rally picketing the White House; she refused bail and was held for 10 days, where she instigated a hunger-strike and was force-fed. The USDA accused her of \"conduct unbecoming a government employee,\" but Hitchcock helped her keep her job. Chase was also an active member of the National Association for the Advancement of Colored People (NAACP). See also: Distinguished authors of previous months. Species of the month Pincushion Cactus Cochemiea fraileana (Britton \u0026 Rose) P.B.Breslin \u0026 Majure in Taxon 70(2): 319. (2021) Some facts about this taxon, one of several species in tribus Cacteae to be called \"Pincushion Cactus\": Size of stem: 3тАУ4 cm in diameter, 15 cm tall. Size of flower: 2.5тАУ3 cm in diameter. Color of flower: Light pink; petals with darker pink median line, stigma yellowish-green. Blooming season: May to September. Habitat: Grows in non calcareous rocks. Place of origin: The small islands of Pichilinque, Cerraibo and Santa Catalina off Baja California. First described: By Nathaniel Lord Britton and Joseph Nelson Rose in 1923 as Neomammillaria ",
