    "content": "Jump to content From Wikipedia, the free encyclopedia Prime Minister of Bulgaria in 2025 In this Bulgarian name, the patronymic is Dimitrov and the family name is Zhelyazkov. Rosen Zhelyazkov ╨а╨╛╤Б╨╡╨╜ ╨Ц╨╡╨╗╤П╨╖╨║╨╛╨▓ Zhelyazkov in 2025 62nd Prime Minister of Bulgaria Caretaker Assumed office 16 January 2025 President Rumen Radev Deputy Tomislav Donchev Atanas Zafirov Grozdan Karadzhov Preceded by Dimitar Glavchev[a] Speaker of the National Assembly In office 19 April 2023 тАУ 25 April 2024 Preceded by Vezhdi Rashidov Succeeded by Raya Nazaryan Member of the National Assembly In office 21 July 2021 тАУ 16 January 2025 Constituency 1st тАФ Blagoevgrad Minister of Transport, Information Technologies and Communications In office 20 September 2018 тАУ 12 May 2021 Prime Minister Boyko Borisov Preceded by Ivaylo Moskovski Succeeded by Georgi Todorov Personal details Born Rosen Dimitrov Zhelyazkov (1968-04-05) 5 April 1968 (age 57) Sofia, PR Bulgaria Party GERB Children 2 Alma mater Sofia University Occupation Politician lawyer Rosen Dimitrov Zhelyazkov (Bulgarian: ╨а╨╛╤Б╨╡╨╜ ╨Ф╨╕╨╝╨╕╤В╤А╨╛╨▓ ╨Ц╨╡╨╗╤П╨╖╨║╨╛╨▓, pronounced [╦Иr╔Фs╔Ыn ╩Т╔Ы╦И╩О╨░sk╔Фf]; born 5 April 1968) is a Bulgarian politician who served as prime minister of Bulgaria from January to December 2025. He resigned on 11 December 2025 following mass protests. He previously served as Minister of Transport from 2018 to 2021, Member of the National Assembly from 2021 to 2025, and Speaker of the National Assembly from 2023 to 2024. He is a member of the conservative GERB party. Early life, education, and career [edit] Zhelyazkov was born in Sofia on 5 April 1968. He earned a master\u0027s degree in Law from Sofia University. In 1994, he began his career as a legal advisor for Sofia Municipality\u0027s Sredets district, where he held senior legal positions as well as positions in the local administration.[4] In 1995, he was accepted into the Sofia Lawyers Association as an attorney specialising in civil and commercial law.[4][5] Political career [edit] Municipal administration [edit] Zhelyazkov held his first political position from 1998 to 1999, when he was Deputy Mayor for \"Law and Control\" of Lozenets district.[5][6][4][7] In 2003, he was appointed as Secretary of Sofia Municipality by then-mayor Stefan Sofiyanski and was re-appointed to the role after the election of Boyko Borisov in 2005.[8] In 2009, after Borisov became prime-minister, Zhelyazkov was given the post of Secretary to the Ministerial Council, a position responsible for the administrative functions of the cabinet.[8] State Administrator [edit] Zhelyazkov served as Secretary to the Ministerial Cabinet between 2009 and 2013 under both Borisov and interim Prime Minister Marin Raykov.[5][6][4][7] In addition, he also served as chairman of the board of the Institute for Public Administration from 2011 to 2013 and represented Bulgaria at the European Institute for Public Administration (EIPA).[9] As secretary to the cabinet under the Raykov Government, Zhelyazkov was implicated in the so-called \"Kostinbrod affair\" surrounding the 2013 Bulgarian parliamentary election. A number of political parties, most notably the BSP, alleged that around 350,000 ballots were printed illegally at a facility in Kostinbrod with the authorisation of the caretaker government.[10] As part of the investigation, Zhelyazkov was charged by the Prosecutor\u0027s Office for dereliction of his duty to oversee the proper printing of ballots.[11] In 2014, the Sofia City Court found no evidence of wrongdoing by Zhelyazkov and ruled that he was innocent.[12] From 2016 to 2017, Zhelyazkov served as a Public Administration and e-Government advisor to Prime Minister Boyko Borisov.[5][6][4][13] In this role, he helped draft legislation for the implementation of e-government in Bulgaria and represented the country at the annual summit for open government partnership.[9] Zhelyazkov was nominated for the position of Chairman of the Commission for the Protection of Competitiveness by GERB in April 2016, but ultimately withdrew his candidacy due to a lack of competition and after an appeal by Borisov for his party to withdraw from the process.[14] On 30 September 2016, he was appointed Chairman of the newly-created State e-Government Agency.[5][4][15] In this role, Zhelyazkov was responsible for overseeing the digitalisation of state services and the implementation of online solutions for government-issued documents.[16][17] In October 2017, he was appointed as head of the Commission for the Regulation of Messages, responsible for overseeing the postal, radio, and e-signature state services.[18] Minister of Transport [edit] On 20 September 2018, Zhelyazkov was elected by the National Assembly as Minister of Transport, Information Technology, and Communications.[5][4] His appointment to the position came following the resignation of his predecessor, Ivaylo Moskovski, following a traffic accident near the town of Svoge.[19] Shortly after his election, Zhelyazkov promised to work closely with the Natio",
