    "content": "Saltu al enhavo El Vikipedio, la libera enciklopedio Bonvenon al Vikipedio La libera enciklopedio redaktebla de ─Йiuj. 379 225 artikoloj en Esperanto 535 aktivaj redaktantoj ┬▒650 000 unikaj vizitantoj monate (2025) Helpo Kategorioj Demandoj Regularo Portaloj Arto Biografioj Filozofio Geografio Historio Matematiko Scienco Socio Teknologio Artikolo de la Monato priskriba teksto Petro Pa┼нlo RUBENS (naski─Эis la 29-an de junio 1577 en Siegen, mortis la 30-an de majo 1640) estis flandra arta pentristo, desegnisto kaj diplomato de la Duklando Brabanto en Suda Nederlando (nuntempa Belgio). Li sendube estas la plej populara flandra majstro de la baroka periodo per troigo de la emfazigitaj movoj, koloroj, kaj sensiveco, kiu disvolvigis fakulajn aspektojn de klasika kaj kristana historio. Oni lin nomas anka┼н Peter Paul, Pieter Paul, Pieter Pauwel a┼н Petrus Paulus. Li estis konata ─Йefe pro kontra┼нreformaciaj altarpecoj (retabloj), portretoj, pejza─Эoj, kaj historiaj pentra─╡oj de mitologiaj kaj alegoriaj temoj. Aldone al laboro en granda studio en Antverpeno kiu produktis pentra─╡ojn ege popularajn inter nobelaro kaj artokolektistoj tra la tuta E┼нropo, krom pentra─╡ojn por tapi┼Эoj. plena artikolo ... Lastaj artikoloj de la monato: Birdoj - Francisco Ant├┤nio de Almeida J├║nior - Amsterdamo Proponu! тАв Elstaraj artikoloj: 314 тАв Legindaj artikoloj: 391 Pri Vikipedio Esperanta Vikipedio Esperanta Vikipedio estas projekto de kunlabora enciklopedio, universala kaj plurlingva, kreita interrete la┼н la vikio-principo. ─Ьi celas liveri en Esperanto liberan, objektivan kaj kontroleblan enhavon, kiun ─Йiuj povas redakti. La projekto estas difinita de la kvin principoj. La enhavo estas disponigata sub la permesilo Krea Komuna─╡o Atribuite-Samkondi─Йe kaj oni povas kopii kaj reuzi ─Эin sub la sama permesilo тАФ e─Й por komercaj celoj тАФ nur respektante la uzkondi─Йojn. ─Иiuj redaktantoj de Esperanta Vikipedio estas volontuloj. Ili partoprenas en la kunlaborema komunumo, sen estro, kie la anoj kunordigas siajn strebojn kadre de temaj projektoj kaj pluraj diskutejoj. Ili sekvas la bazajn regulojn establitajn de la komunumo, ekzemple kontrolebleco de la informo a┼н la menciindeco de la temo. Inter la diversaj helpopa─Эoj disponeblaj al uloj interesataj kontribui, estas la pa─Эoj, kiuj instruas kiel krei pa─Эon a┼н kiel redakti pa─Эon. Se vi havas demandojn, ne hezitu demandi. Manlibro pri Vikipedio тАв Komunuma portalo тАв Konsiletoj тАв Facebook Esperanto kaj Libera Scio Esperanto kaj Libera Scio estas grupo de Esperanto-parolantaj vikimedianoj. Fonda─╡o Vikimedio, kiu funkciigas libersciajn kunlaborajn projektojn inkluzive de la Vikipedio en Esperanto, rekonis ELiSon kiel sian oficialan uzantogrupon (Wikimedia User Group) la 4-an de aprilo 2013. ─Иefa celo de la grupo estas kunigi la Esperanto-parolantojn, kiuj kontribuas al Vikipedio kaj aliaj vikimediaj projektoj a┼н alimaniere deziras subteni liberan scion. Facebook тАв X тАв YouTube тАв Telegram Bildo de la tago Igvano de la specio ctenosaura similis, trovebla en Meksiko, Centr-Ameriko kaj Kolombio. Aldonu la venontan bildon тАв Indekso тАв Elstaraj bildoj en la Komunejo Nuna Kunlabora─╡o Simulada videoludo La nuna kunlabora─╡o estas Tipoj de videoludoj. Bonvolu kunlabori kun ni por levi ─Эin al pli bonkvalita nivelo! Kunlabora─╡o estas specifa temo, pri kiu ─Эis nun ne ekzistas artikolo a┼н nur ─Эermo. Per vasta redakta kunlaboro ni atingu artikolon (a┼н plurajn pri la temo) je nivelo de leginda artikolo a┼н e─Й je nivelo de elstara artikolo. La projekto celas ┼Эtopi bre─Йojn en Vikipedio, fokusigi la intereson de la uzantoj kaj doni al ni ─Йiuj ion, pri kio eblas fieri. ─Иiu ajn povas kandidatigi artikolon kaj vo─Йdoni por kandidato. Regule oni nombras la vo─Йojn kaj la venkinto havos la atenton de kontribuemuloj. Vi povas vo─Йdoni a┼н proponi la postan kandidaton. Anta┼нaj kunlabora─╡oj estis: Mondaj Ludoj de 2025, Ozzy Osbourne, Cifero Vo─Йdonu por la venonta kunlabora─╡oтАж тАв redakti Aktuala─╡oj Gazaa Sektoro en 2025 10-a de decembro 2025 Almena┼н 22 mortoj en Fez, Maroko, pro kolapso de du lo─Эejaroj. Du monatojn post la supozita batal─Йeso en Gaza-strio, Palestino, pluas amasmurdado kaj okazis 350 mortoj pro atakoj fare de Israelo. La koncernaj publikaj dissendantoj de Irlando, Islando, Hispanio, Nederlando kaj Slovenio nuligis sian partoprenon en E┼нrovido 2026 pro la partopreno de Israelo. 7-a de decembro 2025 Okazis pu─Йprovo en Benino. 30-a de novembro 2025 Pro pluvegoj pereis jam 400 homoj en Sumatro (kaj ─Эis 800 en najbaraj landoj). Nombro de la pereintoj dum konflikto inter Israelo kaj Hamaso en Gaza-Sektoro superis 70 000. 29-a de novembro 2025 Okaze de la 78a datreveno de la decido de Unui─Эintaj Nacioj por divido de la teritorio de Palestino por du ┼Эtatoj, tra la mondo okazis centoj da manifestacioj apoge al la palestina popolo kaj kontra┼н la agreso fare de Israelo. Donald Trump anoncis fermon de aviada spaco super Venezuelo, samtempe fortiginte ─Йeeston de usonaj trupoj en la regiono kaj detruadon de boatoj kaj boatistoj apud ties bord",
