    "title": "Wikipedia, a enciclopedia libre",
    "content": "Saltar ao contido Na Galipedia, a Wikipedia en galego. D├бmosche a benvida ├б Galipedia A enciclopedia libre que calquera pode editar s├бbado, 13 de decembro de 2025 Versi├│n para m├│biles Nesta versi├│n en galego, que comezou o 8 de marzo de 2003, xa temos 228тАЙ281 artigos. Benvida COMOs Preguntas frecuentes Comunidade Pol├нticas Artigos de calidade Axuda Artigo destacado Minecraft ├й un videoxogo de mundo aberto tipo sandbox creado orixinalmente polo dese├▒ador e programador sueco Markus \"Notch\" Persson e desenvolvido e publicado posteriormente pola empresa fundada por el, Mojang. Os aspectos creativos e de construci├│n de Minecraft perm├нtenlles ├│s xogadores constru├нr elementos a partir de cubos con diversas texturas nun mundo en tres dimensi├│ns xerado por procedementos. Outras actividades do xogo incl├║en a exploraci├│n, a recolecci├│n de recursos, a confecci├│n de obxectos e o combate. Disp├│n de varios modos de xogo, inclu├нndo un modo de supervivencia no que o xogador debe conseguir recursos para constru├нr o mundo de xogo e manter a s├║a sa├║de, un modo creativo no que os recursos son ilimitados e o xogador ten a capacidade de voar, un modo de aventuras que permite xogar niveis e mapas creados por outros xogadores e un modo espectador no que os xogadores poden voar e observar o mundo pero sen interactuar con el. A versi├│n para PC do xogo destaca pola s├║a comunidade de modding. Outros artigos destacados тАв Artigos de calidade Sobre Galicia Ricardo Courtier, nado na Coru├▒a o 10 de marzo de 1865 e finado en Ourense o 10 de decembro de 1922, foi un m├║sico e compositor galego. Nado nunha familia de m├║sicos, ├й considerado o membro m├бis salientable da terceira xeraci├│n de m├║sicos da saga Courtier. Logo de finalizar a s├║a formaci├│n instalouse na Pobra de Trives, onde foi director da banda de m├║sica. Foi precisamente nesta vila ourens├б onde desenvolveu un intenso labor fundando diversas agrupaci├│ns e compo├▒endo obras que ser├нan interpretadas por estas. Posteriormente trasladouse coa s├║a familia ├б cidade de Ourense, onde residiu ata o seu falecemento, e onde foi director da Banda de M├║sica Municipal. A s├║a obra salienta pola influencia da m├║sica tradicional galega, con harmon├нas sinxelas e formas t├нpicas da m├║sica popular. Ademais do seu labor como compositor, Ricardo Courtier realizou arranxos para as distintas agrupaci├│ns que liderou. Outros artigos destacados sobre Galicia тАв O mes de decembro na cultura popular galega Tal d├нa coma hoxe no ano... 1545, comeza o Concilio de Trento en Trento, Italia. 1937, durante a Segunda Guerra Chinesa-Xaponesa remata a Batalla de Nanjing coa vitoria das tropas xaponesas, dando comezo o Masacre de Nanjing. 1959, Makarios III, arcebispo da Igrexa Ortodoxa Chipriota, conv├йrtese no primeiro presidente de Chipre. 1981, o xeneral Wojciech Jaruzelski declara a lei marcial en Polonia para impedir que Solidaridade desmantele o sistema socialista. 1996, Kofi Annan ├й elixido Secretario Xeral das Naci├│ns Unidas. 2003, Saddam Hussein (na imaxe), ex-presidente de Iraq, ├й capturado preto de Tikrit polas tropas estadounidenses. Hoxe ├й o D├нa da Rep├║blica en Malta (1974). M├бis efem├йrides do d├нa de hoxe тАв Outras Efem├йrides destacadas Imaxe do d├нa Lago Kinney e monte Whitehorn. Vexa o artigo Parque provincial Monte Robson Outras imaxes destacadas тАв Imaxes destacadas en Commons Presentaci├│n A Wikipedia ├й unha enciclopedia universal en li├▒a multiling├╝e, colaborativa e gratu├нta. O prop├│sito da Wikipedia ├й fornecer un contido libre, obxectivo e verificable que todas as persoas poidan editar e mellorar. O proxecto est├б baseado en cinco principios b├бsicos, todo o contido est├б dispo├▒ible baixo a licenza Creative Commons BY-SA e pode ser copiado e reutilizado baixo esta mesma licenza. Benvida тАв ├Нndice da Axuda Participaci├│n Podes consultar a Axuda e a Gu├нa para obter m├бis informaci├│n de como participar, nas que atopar├бs informaci├│n de como comezar a colaborar, editar artigos e usar imaxes libres. En caso de d├║bidas s├нntete libre de preguntar. COMOs тАв Preguntas m├бis frecuentes Comunidade De acordo coas nosas estat├нsticas, temos un total de 161тАЙ812 contas de usuario rexistradas na Galipedia, e entre elas 535 estiveron activas durante o ├║ltimo mes. Todas as persoas que editan a Galipedia son voluntarias, integrando unha comunidade colaborativa e coordinando os esforzos por medio de proxectos tem├бticos e diversos espazos de conversa. Portal da comunidade тАв Pol├нticas e normas Meta-Wiki Meta-Wiki Coordinaci├│n Wikimedia Commons Commons Multimedia Wiktionary Galizionario Dicionario Wikibooks Galilibros Libros Wikisource Galifontes Documentos Wikiquote Galicitas Citas Wikispecies Wikispecies Especies Wikinews Wikinews Novas Wikiversity Wikiversity Aprendizaxe Wikivoyage Wikivoyage Viaxes Wikidata Wikidata Datos MediaWiki MediaWiki Desenvolvemento Obtido de ┬лhttps://gl.wikipedia.org/w/index.php?title\u003dPortada\u0026oldid\u003d7053480┬╗ Categor├нa: ├Нndice Categor├нa agochada: Wikipedia:Artigos con extractos 40 linguas Aragon├йs ╪з┘Д╪╣╪▒╪и┘К╪й Asturianu C",
