    "title": "V├╝kiped",
    "content": "Jump to content Se V├╝kiped: sikloped libik Benok├╢m├╢ ini V├╝kiped: sikloped libik, keli alan dalon redak├╢n. V├╝kiped Volap├╝kik ├дprimon t├╝ 2004, yanula d. 27id; atimo pabevobons is yegeds 46,525. (Yegeds m├╢dik pejafons med├╝ n├╝n├╢maprogram itj├дfidik) Yeged adelo pev├дl├╢l Hiel John Ronald Reuel Tolkien (1892 yanul 3 тАУ 1973 setul 2) ├дbinom p├╝kavan, lautan ├д prof├дsoran Lingl├дnik, sev├дdik as lautan lebukas: The Hobbit e The Lord of the Rings (\u003d S├╢l Linas). ├Дbinom prof├дsoran V├╢naт╕ЧLingl├дnap├╝ka in niver di Oxford de 1925 j├╝ 1945 e poso prof├дsoran P├╝ka e Literata Lingl├дnikas de 1945 j├╝ 1959. ├Дbinom romakatulan fiedik. ├Дbinom flen gudik hiela C. S. Lewis; bofikans ├дdutoms l├╝ bespikagrup literatik no cal├╢fik: el Inklings. P├дc├дlom B├╝dan Roda Lampor├дna Brit├дnik (C.E.B.) fa jireg: Elizabeth II t├╝ 1972 m├дzul 28. N├дi lebuks: Hobbit e S├╢l Linas, son ela Tolkien: Christopher Tolkien ├дp├╝bom vobotis votik stab├╝ penets fata okik. Vobots ats (kels kenin├╝kons eli Silmarillion famik) e votiks fomons kobo yumed gretik konotas, jenotemas e p├╝kas pedatik├╢las, ed i yegedas literatik d├╢ vol pefom├дl├╢l lab├╝ nem: Arda, e patiko Z├дnodaт╕ЧTal (in Lingl├дnap├╝k: Middle-earth (pedefom├╢l de fom pelingl├дn├╝k├╢l v├╢da V├╢naт╕ЧNorg├дnap├╝kik: Mi├░gar├░r : l├дn fa mens pabelod├╢l ma miteodem germik), kel kanoy dientif├╝k├╢n as тАЮpaset votikтАЬ vola obsik. El Tolkien ├дgebom v├╢di: legendarium (\u003d kon├дdem) tef├╝ lautots valik at. El Tolkien binom ve├╝tik noe as lautan, abi as p├╝kajafan: pato el Quenya ed el Sindarin, kels pledons rouli in Z├дnodaт╕ЧTal, d├╝tons l├╝ p├╝ks lekanik b├дldik├╝n e pesevik├╝n. To lautans votik ip├╝bons literatotis mag├дlik b├╝ el Tolkien, benosek legretik e flun lun├╝pik vobotas omik ├дkodons cedi p├╢pedik, das ├дbinom fatan literata mag├дlik nul├дdik тАУ u kuratikumo: fatan тАЮmag├дlaliterata l├╢pikтАЬ Hiel L. Sprague de Camp e votikans cedons omi тАЮfatani mag├дlaliterata nul├дdikтАЬ kob├╝ hiel Robert E. Howard (jafam ela Conan: Barbaran). Alo el Tolkien nendoto eflunom levemo lautotis posik e mag├дlaliterati in valem. (Yeged l├╢lik...) Magod avigo pev├дl├╢l Fotografot at jonon s├дm├дdi limanamaz├╢ta (s├╢la: Gunnar Ljusterdal: Volap├╝kan Sved├дnik) Dil├дda valemik feda Volap├╝kaklubas: dil├дd bev├╝netik Volap├╝kakluba valemik Ned├дnik, ├╝n 1932 p├дd├╢nulif├╢f├╝k├╢l fa hiels Arie de Jong e J. G. M. Reynders Sr. Limans Dil├дda valemik, so├дs limans Volap├╝kakluba valemik, ├дgetons glato klubaj├дfidoti: Volap├╝kagased pro Ned├дnap├╝kans. Limanam ├дdulon yel bal. Sevol-li, ... ...das hiel Ebbe Vilborg ├дbinom l├дtikan, kel ├дdagetom diplomi tidana Volap├╝ka (n├╝m: 1824) med├╝ cifaladaleb├╝d ├╝n 1961? ...das m├╢diks vot├╝kamas in Volap├╝k nulik hiela Arie de Jong ya pimobons fa Volap├╝kans votik (a.s. hiel Auguste Kerckhoffs u hiel Rupert Kniele)? ...das Volap├╝kaklub di N├╝rnberg, keli hiel Leopold Einstein ├дs├╝ad├╝kom ad ved├╢n Sperantaklub balid, poso ├дl├╝vom Sperantamufi ed ├дslopikom eli Ido? ...das Volap├╝kamuf ├дnin├дdon vomis j├дfedik, so├дs├д jiel Henriette Wolter, kel p├дc├дlof fa Schleyer as cif balid pro Nol├╝da-Deut├дn, jiel Marie Johanna Verbrugh, kel ├дlautof tidodemi gretik Volap├╝ka pro Ned├дnans ├дsi pen├дdis votik m├╢dik, jiel Maria Tommasi, kel ├дdunof otosi pro Litaliy├дnans, u jiel Anna Petersen, kel ├дvedof presidan balid Volap├╝kakluba di Thoreby (Dan├дn) tim├╝ f├╝n onik? (Ek├╢! lised jivolap├╝kanas famik.) Leyans ve├╝tik├╝n KLADS CIFIK: JENAV KAENAV LEKANS LIFAJEN├ДDS NOLAVS P├ЬKAV REL E FILOSOP SOG├ДDAV SPOTS TALEDAV VOB V├ЬKIPEDIK: Kafetar тАУ Komotanefaleyan тАУ Lised lafabetik yegedas Yegeds ma j├дf├╝d тАУ Yegeds pev├дl├╢l тАУ Magods pev├дl├╢l Yegeds gudik тАУ Yegeds no pefipen├╢ls тАУ Liseds valasotik тАУ Suk V├ЦDEMS IN VOLAP├ЬK VOLAP├ЬK.COM (resodatoped cal├╢fik Vpa) Coged dela Dug├дd├╝ jiflen el тАЪfilmstarтАЫ mu yunik: тАЪJane SmithтАЫ ├дvisitof neitaklubi in тАЪHollywoodтАЫ. Sematim├╝lo el тАЪJaneтАЫ ├дmutof geb├╢n prifeti vo j├╢niko pestit├╢li kluba. Ab ek├╢! su v├╢l detik prifeta ├дk├╝pof p├дnoti, kel ├дmagom eli тАЪAdamтАЫ in stad ti nat├дdik. FIgabimabled smalik ├дkloton mani t├╢bo. Dis p├дnot at ├дkanoy log├╢n nunedi: тАЪTovol├╢d nef├╢ro figabimabledili!тАЫ тАЪJaneтАЫ ├дbinof ├дs el тАЪEvaтАЫ rafinik e so nuned at ├╢vedon mif├дt pro vom├╝l: esuemol ya, das no ├дkanof dam├╝t├╢n nul├дli okik... No lun├╝po pos├д itovof bledili e somo ilogedof gen├дmis rumana bid├дda obsik, klok├╝lis ga m├╢diks ├дprimons ad ton├╢n ed i horns mu m├╢diks ├дprmons ad beblad├╢n. Bluviko vom├╝l ├дg├╝flekof ed ├дmogolof vifiko se prifet... Ab in lecem p├дgetedof in stralamel fl├дk├╢malampadas blein├╝k├╢l, du musigalef kluba ├дpl├дyon fafari laodik e komanef ├дkaniton li├дni lida: тАЪElogof mani l├╢lik! Elogof mani l├╢lik!тАЫ (Lektinakaenan il├╝blinom kontagiani v├╝ penid dis bledil su p├дnot prifetik e paratem in lecem kluba.) Fom├дlols├╢s bluvi ela тАЪJane SmithтАЫ! Volap├╝kagased (Z├дnagased pro Volap├╝kanef) 1959, n├╝m: 5, pad: 22. Kis binon-li Volap├╝k? Erkl├дrungen f├╝r Deutschsprechende Explications pour francophones Obja┼Ыnienia dla polskoj─Щzycznych Uitleg voor Nederlandstaligen Klarigo por Esperanto-parolantoj Clarification for English speakers Aclaraci├│n para hispanohablantes ╨Ю╨▒╤К╤П╤Б╨╜╨╡╨╜╨╕╨╡ ╨┤╨╗╤П ╤А╤Г╤Б╤Б╨║╨╛╨│╨╛╨▓╨╛╤А╤П╤Й╨╕╤Е Spiegazioni in lingua italiana цЧецЬмшкЮшй▒шАЕуБочЪЖцзШуБ╕ V├╝kiped in yufap├╝ks votik Esperan",
