    "url": "https://en.wikipedia.org/wiki/Wikimedia_Foundation",
    "title": "Wikimedia Foundation - Wikipedia",
    "content": "Jump to content Coordinates: 37┬░47тА▓21тА│N 122┬░24тА▓12тА│Wя╗┐ / я╗┐37.78917┬░N 122.40333┬░Wя╗┐ / 37.78917; -122.40333 From Wikipedia, the free encyclopedia American charitable organization For information about the Wikimedia Foundation\u0027s involvement with the English Wikipedia, see Wikipedia:Wikimedia Foundation. Wikimedia Foundation, Inc. Abbreviation WMF Founded June 20, 2003; 22 years ago (2003-06-20), St. Petersburg, Florida, U.S. Founder Jimmy Wales Type 501(c)(3), charitable organization Tax ID no. EIN 200049703 Focus Free, open-content, multilingual, wiki-based Internet projects Location One Sansome Street San Francisco, California, U.S. Area served Worldwide (banned in some territories) Products Wikipedia, MediaWiki, Wikibooks, Wikidata, Wikifunctions, Wikimedia Commons, Wikinews, Wikiquote, Wikisource, Wikispecies, Wikiversity, Wikivoyage, Wiktionary Membership Board-only CEO Maryana Iskander Revenue $185.4 million (2024) $180.2 million (2023) $167.9 million (2022) Expenses $178.6 million (2024) $168.3 million (2023) $145.8 million (2022) Endowment \u003e $100 million (2021) Employees 650 (2025) [1] Volunteers 277,000 (2024) Website wikimediafoundation.org foundation.wikimedia.org (Governance) ASNs 14907, 11820 [2][3][4][5][6] The Wikimedia Foundation, Inc. (WMF) is an American 501(c)(3) nonprofit organization headquartered in San Francisco, California, and registered there as a charitable foundation.[7] The Foundation is most known for being the host of Wikipedia, one of the most visited websites in the world. It also hosts fourteen related open collaboration projects, and supports the development of MediaWiki, the wiki software which underpins them all.[8][9][10] The foundation was established in 2003 in St. Petersburg, Florida by Jimmy Wales, as a non-profit way to fund Wikipedia and other wiki projects[2] which had previously been hosted by Bomis, Wales\u0027 for-profit company.[2] The Wikimedia Foundation provides the technical and organizational infrastructure to enable members of the public to develop wiki-based content in languages across the world.[11] The foundation does not write or curate any of the content on the projects themselves.[12] Instead, this is done by volunteer editors, such as the Wikipedians. However, it does collaborate with a network of individual volunteers and affiliated organizations, such as Wikimedia chapters, thematic organizations, user groups and other partners. The foundation finances itself mainly through millions of small donations from readers and editors, collected through email campaigns and annual fundraising banners placed on Wikipedia and its sister projects.[13] These are complemented by grants from philanthropic organizations and tech companies, and starting in 2022, by services income from Wikimedia Enterprise. As of 2023, it has employed over 700 staff and contractors, with net assets of $255 million and an endowment which has surpassed $100 million. History Further information: History of Wikipedia Jimmy Wales and Larry Sanger founded Wikipedia in 2001 as a feeder project to supplement Nupedia. The project was originally funded by Bomis, Wales\u0027s for-profit business, and edited by a rapidly growing community of volunteer editors. The early community discussed a variety of ways to support the ongoing costs of upkeep, and was broadly opposed to running ads on the site,[14] so the idea of setting up a charitable foundation gained prominence.[15] That addressed an open question of what entity should hold onto trademarks for the project. The Wikimedia Foundation was incorporated in St. Petersburg, Florida, on June 20, 2003.[2][16][17] A small fundraising campaign to keep the servers running was run in October 2003.[18] In 2005, the foundation was granted section 501(c)(3) status by the U.S. Internal Revenue Code as a public charity, making donations to the foundation tax-deductible for U.S. federal income tax purposes.[19] Its National Taxonomy of Exempt Entities (NTEE) code is B60 (Adult, Continuing education).[20][21] The foundation filed an application to trademark the name Wikipedia in the US to the Board of Patent Appeals and Interferences on September 14, 2004. The mark was granted registration status on January 10, 2006. Trademark protection was accorded also by Japan on December 16, 2004, and by the European Union on January 20, 2005. Subsets of Wikipedia were already being distributed in book and DVD form, and there were discussions about licensing the logo and wordmark.[22] On December 11, 2006, the foundation\u0027s board noted that it could not become a membership organization, as initially planned but not implemented, due to an inability to meet the registration requirements of Florida statutory law. The bylaws were accordingly amended to remove all references to membership rights and activities.[23] In 2007, the foundation decided to move its headquarters from Florida to the San Francisco Bay Area. Considerations cited for choosing San Francisco were proximity to like-min",
