    "url": "https://en.wikipedia.org/wiki/2025_Bondi_Beach_shooting",
    "title": "2025 Bondi Beach shooting - Wikipedia",
    "content": "Jump to content Coordinates: 33┬░53тА▓21.5тА│S 151┬░16тА▓41.7тА│Eя╗┐ / я╗┐33.889306┬░S 151.278250┬░Eя╗┐ / -33.889306; 151.278250 From Wikipedia, the free encyclopedia Terrorist attack in Sydney, Australia A request that this article title be changed to Bondi Beach shootingBondi Beach shooting is under discussion. Please do not move this article until the discussion is closed. This article documents a recent shooting and may change rapidly. Please update outdated or incomplete information with citations to reliable sources. (December 2025) (Learn how and when to remove this message) 2025 Bondi Beach shooting The gunmen on the Campbell Parade footbridge, shooting towards Archer Park. The view is from the west. Location of the shooting in Sydney Location Archer Park, Bondi Beach, Sydney, New South Wales, Australia Date 14 December 2025 (2025-12-14) c. 18:47[1] (AEDT, UTC+11:00) Target Jews Attack type Mass shooting Deaths 16 (including one gunman)[2] Injured 43 (including one gunman)[1] Assailants 2 Motive Antisemitism[3] Part of a series on Terrorism in Australia Notable attacks Sydney Yugoslav General Trade and Tourist Agency bombing (1972) Sydney Hilton bombing (1978) Sydney Israeli consulate and Hakoah Club bombings (1982) Russell Street bombing (1986) Turkish consulate bombing (1986) French consulate bombing (1995) Endeavour Hills stabbings (2014) Lindt Cafe siege (2014) Parramatta shooting (2015) Queanbeyan stabbing attacks (2017) Brighton siege (2017) Mill Park stabbing (2018) Melbourne stabbing attack (2018) Wakeley church stabbing (2024) Melbourne synagogue arson attack (2024) Bondi Beach shooting (2025) Notable plots Sydney terrorism plot (2005) Holsworthy Barracks terror plot (2009) Australian aeroplane terror plot (2017) Counter-terrorism Legislation Anti-terrorism legislation (2004) Anti-terrorism legislation (2005) Designated terrorist organisations Raids Counter-terrorism raids (2014) v t e A terrorist mass shooting occurred on 14 December 2025 at Archer Park beside Bondi Beach in Sydney, Australia. This took place during a Hanukkah celebration hosted by the Chabad of Bondi in which a thousand people were in attendance. Authorities declared it a terrorist incident, and numerous world leaders and news outlets described it as antisemitic. Sixteen people were killed, including a child and one of the two perpetrators, with the second shooter in custody. A bystander had intervened and disarmed one of the gunmen. Police said the alleged gunmen were father and son. Forty-two people, including at least two police officers, were injured and taken to various hospitals. The New South Wales Police Force responded to the incident, and police later found and removed a suspected homemade bomb from a car belonging to one of the shooters. Prime Minister Anthony Albanese said it was a deliberate attack on Jewish people during the first day of Hanukkah. It is the deadliest mass shooting in Australia since the Port Arthur massacre in 1996, and the deadliest terror incident in Australian history. Before the attack, Australia already had one of the strictest gun laws in the world. Background Bondi Beach is one of Australia\u0027s most popular seaside areas. It is located in Sydney\u0027s eastern suburbs; this area is known as the centre of the Jewish community of Sydney, which in turn is one of the two largest Jewish communities in Australia (the other being in Melbourne).[4] The Bondi area of Sydney had experienced recent heightened security concerns due to the Bondi Junction stabbings in April 2024.[5][6] Australia had experienced an increase in attacks on Jewish communities and individuals since the beginning of the Gaza war in October 2023.[7][8] In August 2024, the Australian Security Intelligence Organisation (ASIO) lifted Australia\u0027s national terrorism threat level from \"possible\" to \"probable\", citing the risk of community tensions and political violence related to the Gaza war as one of the reasons for doing so.[9][10] The incident took place at an annual Chabad community event (\"Chanukah by the Sea\"), to celebrate the beginning of Hanukkah.[11][12] The event was held at Archer Park just east of the Bondi Pavilion, and was attended by nearly 1,000 people.[1] Before the attack, Australia already had one of the strictest gun laws in the world, following the 1996 Port Arthur massacre. This made it harder to store guns and firearms.[13] Assault rifles, shotguns, and many semiautomatic rifles were banned.[citation needed] In spite of this, the number of firearms in Australia, and the number of people licensed to own them, had increased since the Port Arthur massacre. In New South Wales, the state where the shooting took place, there were 260,000 gun licences in 2025, up from 181,000 in 2001.[14][15] Attack 120m 131yds 3 2 1 1 Footbridge 2 Archer Park 3 Bondi Beach External videos Bondi Shooter disarmed by hero bystander Drone video allegedly shows final moments of Bondi Beach shooting People fleeing the scene of the terror attack Initial vi",
