    "content": "Jump to content From Wikinews, the free news source you can write! Welcome to Wikinews The free news source you can write! Monday, December 15, 2025, 1844 (UTC) Copy us тАв Newsroom тАв Mission тАв Report breaking news тАв Donate Audio Wikinews тАв Social media тАв Chat тАв Best of Wikinews NBI seeks Interpol Red Notice for former lawmaker Zaldy Co On Friday, the National Bureau of Investigation of the Philippines (NBI) requested an Interpol Red Notice be issued against former Ako Bicol Congress representative Zaldy Co. An Interpol Red Notice seeks a personтАЩs provisional arrest for extradition or similar legal action and is often described as an тАЬinternational warrant,тАЭ Rappler reports, though it does not require countries to arrest the subject. [MPL] [ ┬▒ ] - Image credit - Read more... Latest news ┬▒ NBI seeks Interpol Red Notice for former lawmaker Zaldy Co Battery explosion triggers fatal office fire in JakartaтАЩs Kemayoran district Football: Nottingham Forest defeat FC Utrecht 2-1 Iceland pulls out of Eurovision 2026, joining four other countries to do so 10-man Preston North End draw with Coventry City in Championship fixture Four countries back out of Eurovision 2026 amid ongoing boycott Robert Dick and Mark Dresser re-unite at the Fridman Gallery Raccoon found passed out in liquor store after drunken rampage Australian MP Barnaby Joyce resigns from the National Party Wikinews interviews the President of WSA: today\u0027s World Passports and World Citizen Government Midtown Manhattan Nightclub Shooting: one killed, shooter at large Shooting at Benihana restaurant in Maple Grove, Minnesota leaves one injured Wikinews attends Veterans Day event in Texas, United States Current New York Police Department commissioner agrees to stay on for Mamdani\u0027s mayoralty Turkish military transport plane crashes near Georgia border, 20 dead 2025 Queens World Film Festival features filmmakers breakfast and ceremony honoring Warrington Hudlin Wikinews interviews magician and illusion builder Bruce Chadwick for National Magic Week Russian \"Art Night\" in Crimea: Wikinews interviews Traveler Viktor Pinchuk Mamdani wins New York City mayoral election Avalanche in Italy\u0027s Dolomite mountains kills five German climbers India wins 2025 Women\u0027s Cricket World Cup, defeating South Africa by 52 runs Crowds gather for 35th Tompkins Square Halloween Dog Parade amid car incident The Voluptuous Horror of Karen Black performs as part of Vaginal Davis\u0027 exhibit at MoMA PS1 Taskforce launched as search for Gus Lamont expands in South Australia\u0027s north Israeli naval ships intercept Gaza-bound Global Sumud Flotilla ┬╗ Older news Battery explosion triggers fatal office fire in JakartaтАЩs Kemayoran district On Tuesday, in Jakarta, Indonesia, a seven storey tall office building in the Kemayoran neighborhood caught on fire, claiming the lives of at least 22 individuals, among them an expectant mother. City police chief Susatyo Purnomo Condro said the fire likely began on the first floor when a battery exploded, igniting the blaze. [ ┬▒ ] - Image credit - Read more... Football: Nottingham Forest defeat FC Utrecht 2-1 Nottingham Forest played an away Europa League league-phase match at Stadion Galgenwaard in Utrecht on Thursday. Igor Jesus came off the bench to score the late winner as Forest beat Utrecht 2тАУ1 in the Netherlands. [ ┬▒ ] - Image credit - Read more... Iceland pulls out of Eurovision 2026, joining four other countries to do so On Wednesday, Iceland withdrew from the Eurovision Song Contest 2026, joining Spain, the Netherlands, Ireland, and Slovenia. Each of the five countries backed out of the contest due to European Broadcasting Union (EBU) confirming Israel\u0027s participation in the 2026 edition. [ ┬▒ ] - Image credit - Read more... Four countries back out of Eurovision 2026 amid ongoing boycott On Thursday, the European Broadcasting Union confirmed Israel\u0027s participation in the Eurovision Song Contest 2026. In response, four countries, Spain, the Netherlands, Ireland, and Slovenia withdrew from the 2026 contest, citing a \"loss\" of neutrality and the humanitarian impact due to the war in Gaza. [ ┬▒ ] - Image credit - Read more... Africa тАв Asia тАв South / Central / North America тАв Europe тАв Middle East тАв Oceania тАв Antarctica Crime and law тАв Culture and entertainment тАв Disasters and accidents тАв Economy and business тАв Education тАв Environment Health тАв Obituaries тАв Politics and conflicts тАв Science and technology тАв Sports тАв Wackynews тАв Weather Write an article!┬▒ Wikinews needs you! We want to create a diverse community around the globe who collaborate to report on a wide variety of current news events. Please read the guide or how-to before starting. You might want to check recently created articles to see if your story has already been reported upon. Never edited a wiki before? See our editing help page. Recent interviews ┬▒ Robert Dick and Mark Dresser re-unite at the Fridman Gallery Wikinews interviews the President of WSA: today\u0027s World Passports and World Citizen Gov",
