    "content": "Jump to content From Wikipedia, the free encyclopedia President of the United States from 1861 to 1865 \"President Lincoln\" redirects here. For the troopship, see USS President Lincoln. For other uses, see Abraham Lincoln (disambiguation). Abraham Lincoln Lincoln in 1863 16th President of the United States In office March 4, 1861 тАУ April 15, 1865 Vice President Hannibal Hamlin (1861тАУ1865) Andrew Johnson (MarтАУApr. 1865) Preceded by James Buchanan Succeeded by Andrew Johnson Member of the U.S. House of Representatives from Illinois\u0027s 7th district In office March 4, 1847 тАУ March 3, 1849 Preceded by John Henry Succeeded by Thomas L. Harris Member of the Illinois House of Representatives from Sangamon County In office December 1, 1834 тАУ December 4, 1842 Preceded by Achilles Morris Personal details Born (1809-02-12)February 12, 1809 LaRue County, Kentucky, U.S. Died April 15, 1865(1865-04-15) (aged 56) Washington, D.C., U.S. Manner of death Assassination by gunshot Resting place Lincoln Tomb Party Whig (before 1856) Republican (after 1856) Other political affiliations National Union (1864тАУ1865) Height 6 ft 4 in (193 cm)[1] Spouse Mary Todd (m. 1842) Relatives Lincoln family Occupation Politician lawyer Signature Military service Branch/service Illinois Militia Years of service AprilтАУJuly 1832 Rank Captain[a] Private[a] Battles/wars Black Hawk War (see Abraham Lincoln in the Black Hawk War) Abraham Lincoln[b] (February 12, 1809 тАУ April 15, 1865) was the 16th president of the United States, serving from 1861 until his assassination in 1865. He led the United States through the American Civil War, defeating the Confederate States and playing a major role in the abolition of slavery. Lincoln was born into poverty in Kentucky and raised on the frontier. He was self-educated and became a lawyer, Illinois state legislator, and U.S. representative. Angered by the KansasтАУNebraska Act of 1854, which opened the territories to slavery, he became a leader of the new Republican Party. He reached a national audience in the 1858 Senate campaign debates against Stephen A. Douglas. Lincoln won the 1860 presidential election, prompting a majority of slave states to begin to secede and form the Confederate States. A month after Lincoln assumed the presidency, Confederate forces attacked Fort Sumter, starting the Civil War. As a moderate Republican, Lincoln had to navigate conflicting political opinions from contentious factions during the war effort. Lincoln closely supervised the strategy and tactics in the war effort, including the selection of generals, and implemented a naval blockade of Southern ports. He suspended the writ of habeas corpus in April 1861, an action that Chief Justice Roger Taney found unconstitutional in Ex parte Merryman, and he averted war with Britain by defusing the Trent Affair. On January 1, 1863, he issued the Emancipation Proclamation, which declared the slaves in the states \"in rebellion\" to be free. On November 19, 1863, he delivered the Gettysburg Address, which became one of the most famous speeches in American history. He promoted the Thirteenth Amendment to the U.S. Constitution, which, in 1865, abolished chattel slavery. Re-elected in 1864, he sought to heal the war-torn nation through Reconstruction. On April 14, 1865, five days after the Confederate surrender at Appomattox, Lincoln was attending a play at Ford\u0027s Theatre in Washington, D.C., when he was fatally shot by Confederate sympathizer John Wilkes Booth. Lincoln is remembered as a martyr and a national hero for his wartime leadership and for his efforts to preserve the Union and abolish slavery. He is often ranked in both popular and scholarly polls as the greatest president in American history. This article is part of a series about Abraham Lincoln Personal Early life and career Family Health Religious views Sexuality Patent Artifacts and relics Photographs Black Hawk War Political Spot Resolutions Political career, 1849тАУ1861 Baltimore Plot Douglas debates Views on slavery 16th President of the United States Presidency Transition Inaugurations first second Tenure American Civil War The Union Proclamation 80 Emancipation Proclamation Ten percent plan 13th Amendment Reconstruction Presidential campaigns 1860 election convention 1864 election convention Speeches and works Inaugural speeches first second State of the Union 1861 1862 1863 1864 Lyceum Peoria Lost Speech House Divided Cooper Union Farewell address Gettysburg Poetry \"The Suicide\u0027s Soliloquy\" Bixby letter McCullough letter Assassination Baltimore Plot State funeral Tomb Catafalque Flags Hearse LincolnтАУKennedy coincidences Legacy Historical reputation Memorials Depictions Lincoln\u0027s Birthday Ghost Bibliography Topical guide v t e Family and childhood Early life Main article: Early life and career of Abraham Lincoln Lincoln was born into poverty on February 12, 1809, in a log cabin on Sinking Spring Farm near Hodgenville, Kentucky.[3][1] The second child of Thomas Lincoln and Nancy H",
