    "title": "Hanukkah - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Jewish holiday For other uses, see Hanukkah (disambiguation). Hanukkah ╫Ч╓▓╫а╓╗╫Ы╓╕╓╝╫ФтАО Dreidels, Hanukkah menorah, and sufganiyot Official name ╫Ч╓▓╫а╓╗╫Ы╓╕╓╝╫ФтАО or ╫Ч╓▓╫а╫Х╓╝╫Ы╓╕╓╝╫ФтАО[a] English translation: \u0027Establishing\u0027 or \u0027Dedication\u0027 (of the Temple in Jerusalem) Observed by Rabbinic Jews Type Jewish Significance The Maccabees successfully revolted against Antiochus IV Epiphanes. According to the Talmud, the Temple was purified and the wicks of the menorah miraculously burned for eight days, even though there was only enough sacred oil for one day\u0027s lighting making it a miracle. Celebrations Lighting candles each night. Singing special songs, such as Ma\u0027oz Tzur. Reciting the Hallel prayer. Eating food fried in oil, such as latkes and sufganiyot, and dairy foods. Playing the dreidel game, and giving Hanukkah gelt. Begins 25 Kislev Ends 2 Tevet[b] or 3 Tevet[c] Date 8 of the 9 days: 25 Kislev, 26 Kislev, 27 Kislev, 28 Kislev, 29 Kislev, sometimes 30 Kislev[b], 1 Tevet, 2 Tevet, and sometimes 3 Tevet[c] 2024 date Sunset, 25 December тАУ nightfall, 2 January[1] 2025 date Sunset, 14 December тАУ nightfall, 22 December[1] 2026 date Sunset, 4 December тАУ nightfall, 12 December[1] 2027 date Sunset, 24 December тАУ nightfall, 1 January[1] Related to Purim, Day of Salvation and Liberation as a rabbinically decreed holiday. English Wikisource has original text related to this article: 1 Maccabees Hanukkah table Hanukkah[d] (/╦Иh├жn╔Щk╔Щ/, /╦Иh╔С╦Рn╔Щk╔Щ/; ╫Ч╓▓╫а╓╗╫Ы╓╕╓╝╫ФтАО с╕д─Гnukk─Б listenтУШ) is a Rabbinic Jewish festival commemorating the recovery of Jerusalem and subsequent rededication of the Second Temple following the Jewish Maccabean Revolt against the Seleucid Empire in the 2nd century BCE.[3][4] Hanukkah is observed for eight nights and days,[5] starting on the 25th day of Kislev according to the Hebrew calendar, which may occur at any time from November 28 to December 27 in the Gregorian calendar. The festival is observed by lighting the candles of a candelabrum with nine branches, commonly called a menorah or hanukkiah. One branch is placed above or below the others and its candle is used to light the other eight candles. This unique candle is called the shammash ( ╫й╓╖╫Б╫Ю╓╕╓╝╫й╫БтАО, \"attendant\"). Each night, one additional candle is lit by the shammash until all eight candles are lit together on the final night of the festival.[6] It is the only Jewish holiday to begin in one month (Kislev) and end in another (Tevet) on the Hebrew calendar. Other Hanukkah festivities include singing Hanukkah songs, playing the game of dreidel and eating oil-based foods, such as latkes and sufganiyot (similar to jelly donuts), and dairy foods. Since the 1970s, the worldwide Chabad Hasidic movement has initiated public menorah lightings in open public places in many countries.[7][8] Originally instituted as a feast \"in the manner of Sukkot (Booths)\", it does not come with the corresponding obligations, and is therefore a relatively minor holiday in strictly religious terms. Nevertheless, Hanukkah has attained major cultural significance in North America and elsewhere, especially among secular Jews, due to often occurring around the same time as Christmas during the festive season.[9] This chronological proximity also contributed to the practice of gift-giving among American Jews. Etymology [edit] The name \"Hanukkah\" derives from the Hebrew verb \" ╫Ч╫а╫ЪтАО\", meaning \"to dedicate\", because on Hanukkah, the Maccabees Jews regained control of Jerusalem and rededicated the Temple.[10][11] Many homiletical explanations have been given for the name:[12] The name can be broken down into ╫Ч╫а╫Х ╫Ы╫┤╫ФтАО, \"[they] rested [on the] twenty-fifth\", referring to the fact that the Jews ceased fighting on the 25th day of Kislev, the day on which the holiday begins.[13] ╫Ч╫Щ╫а╫Х╫ЪтАО Chinuch, from the same root, is the name for Jewish education, emphasizing ethical training and discipline. ╫Ч╫а╫Х╫Ы╫ФтАО (Hanukkah) is also the Hebrew acronym for ╫Ч ╫а╫и╫Х╫к ╫Х╫Ф╫Ь╫Ы╫Ф ╫Ы╫С╫Щ╫к ╫Ф╫Ь╫ЬтАО тАУ \"Eight candles, and the halakha is according to the House of Hillel\". This is a reference to the disagreement between two rabbinical schools of thought тАУ the House of Hillel and the House of Shammai тАУ on the proper order in which to light the Hanukkah flames. Shammai opined that eight candles should be lit on the first night, seven on the second night, and so on down to one on the last night (because the miracle was greatest on the first day). Hillel argued in favor of starting with one candle and lighting an additional one every night, up to eight on the eighth night (because the miracle grew in greatness each day). Jewish law adopted the position of Hillel.[14] Psalm 30 is called ╫й╫Щ╫и ╫Ч╫а╫Ы╫к ╫Ф╫С╫Щ╫ктАО Sh├оr с╕д─Гnukk─Бt HaBayit, \"the Song of the \u0027Dedication\u0027 of the House\", and is traditionally recited on Hanukkah. 25 (of Kislev) + 5 (Books of Torah) \u003d 30, which is the number of the song. Alternative spellings [edit] Spelling variations due to transliteration of Hebrew с╕дet Nun Vav Kaf Hey In Hebrew, the word Hanuk",
