    "content": "Ir al contenido De Biquipedia Bienveniu a Biquipedia A enciclopedia libre en aragon├йs. Somos treballando en 50 798 articlos en aragon├йs: Como rechistrar-se ┬╖ FAQ ┬╖ Citar Wikipedia ┬╖ Aviso legal Pachina de Prebatinas ┬╖ A Tabierna ┬╖ Portals ┬╖ Donacions Facebook oficial ┬╖ Twitter oficial editarBienvenida y variedaz dialectals Si charras aragon├йs y te far├нa goyo de tener una Enciclopedia libre en a tuya luenga, alavez tu puez aduyar a fer-la. Pa trobar mas informaci├│n, ves ta la pachina d\u0027Aduya u deixa un mensache en a Tabierna. Tami├йn puez veyer a portalada y colaborar con Biquipedia escribindo en a tuya variedat dialectal: ansotano ┬╖ belset├бn ┬╖ benasqu├йs ┬╖ cheso ┬╖ chistab├нn fovano ┬╖ ribagorzano ┬╖ sobrarb├йs ┬╖ tensino Pa mas informaci├│n, se veiga Variedaz dialectals editarComunidat Not Aragonese? an-0? - Click here. Si tiens mas dandalos sobre cuestions ling├╝isticas, puez preguntar-los en uso d\u0027a luenga. Tami├йn puez veyer as convencions consensuadas por os miembros d\u0027a comunidat en ortograf├нa consensuada. Os correctors aduyan a que toz os articlos s├нan correctos. Pasa-te tami├йn por o portal d\u0027a comunidat y a tabierna ta comentar cosas con a resta d\u0027a comunidat. No sabes por a on prencipiar? ves ta a lista d\u0027articlos que toda Wikipedia habr├нa de tener y prencipia a editar os articlos que veigas en royo, u bien enampla os que que veigas que pueden estar amilloraus. Si quiers saber-ne mas, puez vesitar a pachina d\u0027aduya. Vesita os Portals tematicos. Si quiers aprender o funcionamiento d\u0027a wikipedia, puez fer prebatinas en a pachina de prebatinas. Aqu├н puez veyer as estatisticas actualizadas de Biquipedia. Acceso WAP: Wapedia.mobi en aragon├йs. editarDestacau Willem Dafoe Mississippi Burning (t├нtol orichinal en angl├йs, en aragon├йs Mississippi ardendo, estrenada en Arag├│n con o t├нtol en castellano de Arde Mississippi) ye una cinta de drama d\u0027intriga policiaca dirichida en 1988 por Alan Parker seguntes un gui├│n orichinal de Chris Gerolmo (basau en feitos reals), con una banda sonora orichinal de Trevor Jones y una direcci├│n de fotograf├нa de Peter Biziou. Producida por Frederick Zollo y Robert F. Colesberry ta la productora Orion Pictures, en l\u0027elenco d\u0027a cinta se troban actors como Gene Hackman, Willem Dafoe, Frances McDormand, Brad Dourif u Michael Rooker, entre d\u0027atros. Chris Gerolmo escribi├│ lo gui├│n d\u0027a cinta en basando-se en un caso real, os asasinatos de Chaney, Goodman y Schwerner, cuan en chunio de 1964 personaches vinclaus a lo Ku Klux Klan (KKK) asasinoron a tres activistas por os dreitos civils, James Chaney, Andrew Goodman y Michael Schwerner, en a localidat de Philadelphia, en l\u0027estau de Mississippi, con a complicidat u mesmo participaci├│n activa de miembros d\u0027a polic├нa local. Gene Hackman y Willem Dafoe en son os protagonistas, en interpretar a dos achents d\u0027o FBI encargaus d\u0027a investigaci├│n d\u0027o caso, con l\u0027animadversi├│n y hostilidat d\u0027a poblaci├│n local que, por motivos racistas, refirma l\u0027actuaci├│n d\u0027o KKK en l\u0027asasinato. Leyer m├бs... editarYa sabebas que... l\u0027actual estato alem├бn de Baden-Wurtemberg ye o resultado d\u0027a uni├│n d\u0027os estatos independients de Baden y Wurtemberg en referendum popular en 1952? o bucardo pirenenco (Capra pyrenaica pyrenaica) yera un sozespecie d\u0027o bucardo, extinchita dende l\u0027anyo 2000 y que antigament yera abundant en totz os Pireneus? a Cinca ye o m├бs gran afluyent de l\u0027Ebro en tota la suya compleganza, con una compleguera propia de 9.699 km┬▓ que abastan 3.903 hm┬│ promeyos? editarTodas as luengas Wikipedia ye una enciclopedia libre y multiling├╝e. O prochecto en aragon├йs escomenz├│ lo 21 de chulio de 2004. Bi ha wikipedias en muitas atras luengas d\u0027o mundo, y entre ellas, beluna relacionada con l\u0027aragon├йs: As 15 m├бs grans: English (Angl├йs) ┬╖ Deutsch (Alem├бn) ┬╖ Fran├зais (Franc├йs) ┬╖ Polski (Polaco) ┬╖ цЧецЬмшкЮ (Chapon├йs) ┬╖ Italiano ┬╖ Nederlands (Neerland├йs) ┬╖ Portugu├кs (Portugu├йs) ┬╖ Espa├▒ol (Espanyol) ┬╖ Svenska (Sueco) ┬╖ ╨а╤Г╤Б╤Б╨║╨╕╨╣ (Ruso) ┬╖ ф╕нцЦЗ (Chin├йs) ┬╖ Suomi (Finland├йs) ┬╖ Norsk (Noruego) ┬╖ Catal├а (Catal├бn) Atras luengas romances u relacionadas con l\u0027aragon├йs: Arm├вneashti (Arumano) ┬╖ Asturianu (Asturiano) ┬╖ Walon (Val├│n) ┬╖ Estreme├▒u (Estremenyo) ┬╖ Euskara (Basco) ┬╖ V├иneta (Veneciano) ┬╖ Corsu (Corso) ┬╖ Ladino (Chodigoespanyol) ┬╖ Emili├а (Emiliano) ┬╖ Arpitan (Francoprovenzal) ┬╖ Furlan (Friulano) ┬╖ Galego (Gallego) ┬╖ Latina (Lat├нn) ┬╖ L├нguru (Ligur) ┬╖ Lumbaart (Lombardo) ┬╖ Mirand├йs (Mirand├йs) ┬╖ ╨Ь╨╛╨╗╨┤╨╛╨▓╨╡╨╜╤П╤Б╨║╤Н (Moldavo) ┬╖ Nnapulitano (Napolitano) ┬╖ Nouormand/Normaund (Normando) ┬╖ Occitan (Occit├бn) ┬╖ Piemont├иis (Piemont├йs) ┬╖ Rumantsch (Retorromanico) ┬╖ Rom├вn─Г (Rumano) ┬╖ Sardu (Sardo) ┬╖ Sicilianu (Siciliano) ┬╖ Tarand├нne (Tarantino) Arte, literatura, ling├╝istica, musica Arquitectura ┬╖ Arte ┬╖ C├│mic ┬╖ Danza ┬╖ Disenyo ┬╖ Fotograf├нa ┬╖ Literatura ┬╖ Ling├╝istica ┬╖ Musica ┬╖ Pintura ┬╖ Escultura ┬╖ Teatro ┬╖ Cine Ocio y sociedat Coleccionismo ┬╖ Chardiner├нa ┬╖ Chuego ┬╖ Espectaclos ┬╖ Esporte ┬╖ Gastronom├нa ┬╖ Internet ┬╖ Meyos de comunicaci├│n ┬╖ Ocio ┬╖ Periodismo ┬╖ Televisi├│n ┬╖ Turismo ┬╖ Videochuegos Tecnoloch├нa y cien",
