    "content": "Jump to content From Wikipedia, the free encyclopedia English writer (1943тАУ2025) Joanna Trollope CBE Trollope in 2011 Born (1943-12-09)9 December 1943 Minchinhampton, Gloucestershire, England Died 11 December 2025(2025-12-11) (aged 82) Oxfordshire, England Pen name Caroline Harvey Occupation Novelist Language English Period 1978тАУ2025 Spouse David Roger William Potter (m. 1966; div. 1983) Ian Curteis (m. 1985; div. 2001) Children 4 Relatives Anthony Trollope Joanna Trollope (/╦Иtr╔Тl╔Щp/ TROL-╔Щp; 9 December 1943 тАУ 11 December 2025) was an English writer. She also wrote under the pseudonym of Caroline Harvey. Her novel Parson Harding\u0027s Daughter won the 1980 Romantic Novel of the Year Award by the Romantic Novelists\u0027 Association.[1] Early life [edit] Joanna Trollope was born on 9 December 1943 at her grandfather\u0027s rectory in Minchinhampton, Gloucestershire, England, the daughter of Rosemary Hodson and Arthur George Cecil Trollope.[2][3] Her father was an Oxford University classics graduate who became head of a small building society. Her mother was an artist and writer.[4] Her father was away for Second World War service in India when she was born; he returned when she was three. The family settled in Reigate, Surrey. Trollope had a younger brother and sister. She was educated at Reigate County School for Girls,[5] gaining a scholarship to St Hugh\u0027s College, Oxford, in 1961. She read English.[6] Her father was of the same family as the Victorian novelist Anthony Trollope; she was his fifth-generation niece,[7] and was a cousin of the writer and broadcaster James Trollope. Of inheriting the name, she said: Oddly my name has been no professional help at all! It seems to have made no difference ... I admire him hugely, both for his benevolence and his enormous psychological perception.[8] Career [edit] From 1965 to 1967, she worked at the Foreign and Commonwealth Office. While a civil servant, she researched Eastern Europe and the relations between China and the developing world.[9] From 1967 to 1979, she was employed in a number of teaching posts before she became a writer full-time in 1980. Trollope began writing historical romances under the pseudonym of Caroline Harvey, the first names of her father\u0027s parents. She formed the view that: \"It was the wrong genre for the time.\"[4] Encouraged by her second husband, Ian Curteis, she switched to the contemporary fiction for which she became known.[10] The Choir, published in 1987, was her first contemporary novel.[7] The Rector\u0027s Wife, published in 1991, displaced Jeffrey Archer from the top of the hardback bestseller lists. As an explanation, she said in 2006: \"except for thrillers there was nothing in the middle ground of the traditional novel, which is where I think I am.\"[4] In 1992, only Jilly Cooper\u0027s Polo and Archer\u0027s As the Crow Flies were stronger paperback bestsellers. \"I think my books are just the dear old traditional novel making a quiet comeback\", she told Geraldine Bedell in a 1993 interview for The Independent on Sunday.[5] Often described as Aga sagas, for their rural themes, only two of Trollope\u0027s novels (by 2006) actually feature an Aga.[4] The term\u0027s entry in The Oxford Companion to English Literature (2009) states that \"by no means all her work fits the generally comforting implications of the label\".[11] Rejecting the label as not being accurate, Trollope told Lisa Allardice, writing for The Guardian in 2006: \"Actually, the novels are quite subversive, quite bleak. It\u0027s all rather patronising isn\u0027t it?\"[4] Allardice disputed the \"cosy reputation\" Trollope\u0027s books had acquired as her novels had \"tackled increasingly thorny issues including lesbianism, broken families and adoption, the mood growing darker with each novel.\"[4] Terence Blacker, who coined the term for Trollope\u0027s fiction in Publishing News in 1992,[11] admitted a decade later that he \"felt terribly guilty\" for lumbering Trollope with the phrase.[12][13] Trollope told Bedell in 1993 that her fiction does \"the things the traditional novel has always done\" by mirroring reality and exploring \"people\u0027s emotional lives\". Bedell observed that her novels until then were: never suburban, which is the real condition of most of England. Trollopian action takes place in large village houses, at vast kitchen tables; her doctors, vicars, solicitors and craft-gallery owners may worry about money, as her own parents did, but they don\u0027t have any social anxieties: they are invited for drinks at the big house as a matter of course. The books are as economically prestigious, and quite as aspirational in their own way, as the glitter blockbusters of the Eighties.[5] In 2009, she donated the short story The Piano Man to Oxfam\u0027s \u0027Ox-Tales\u0027 project, four collections of UK stories written by 38 authors. Trollope\u0027s story was published in the \u0027Water\u0027 collection.[14] She wrote the first novel in Harper Collins updating of the Jane Austen canon, The Austen Project. Her version of Sense and Sensibility was publishe",
