    "content": "Jump to content From Wikipedia, the free encyclopedia Calendar year Years Millennium 2nd millennium Centuries 10th century 11th century 12th century Decades 1000s 1010s 1020s 1030s 1040s Years 1022 1023 1024 1025 1026 1027 1028 v t e 1025 by topic Leaders Political entities State leaders Religious leaders Birth and death categories Births тАУ Deaths Establishments and disestablishments categories Establishments тАУ Disestablishments v t e 1025 in various calendars Gregorian calendar 1025 MXXV Ab urbe condita 1778 Armenian calendar 474 ╘╣╒О ╒Ж╒А╘┤ Assyrian calendar 5775 Balinese saka calendar 946тАУ947 Bengali calendar 431тАУ432 Berber calendar 1975 English Regnal year N/A Buddhist calendar 1569 Burmese calendar 387 Byzantine calendar 6533тАУ6534 Chinese calendar чФ▓хнРх╣┤ (Wood Rat) 3722 or 3515 тАФ to тАФ ф╣Щф╕Сх╣┤ (Wood Ox) 3723 or 3516 Coptic calendar 741тАУ742 Discordian calendar 2191 Ethiopian calendar 1017тАУ1018 Hebrew calendar 4785тАУ4786 Hindu calendars - Vikram Samvat 1081тАУ1082 - Shaka Samvat 946тАУ947 - Kali Yuga 4125тАУ4126 Holocene calendar 11025 Igbo calendar 25тАУ26 Iranian calendar 403тАУ404 Islamic calendar 415тАУ416 Japanese calendar Manju 2 (ф╕Зхп┐я╝Тх╣┤) Javanese calendar 927тАУ928 Julian calendar 1025 MXXV Korean calendar 3358 Minguo calendar 887 before ROC ц░СхЙН887х╣┤ Nanakshahi calendar тИТ443 Seleucid era 1336/1337 AG Thai solar calendar 1567тАУ1568 Tibetan calendar р╜др╜▓р╜Др╝Лр╜Хр╜╝р╝Лр╜Цр╛▒р╜▓р╝Лр╜Цр╝Лр╜гр╜╝р╝Л (male Wood-Rat) 1151 or 770 or тИТ2 тАФ to тАФ р╜др╜▓р╜Др╝Лр╜Шр╜╝р╝Лр╜Вр╛│р╜Др╝Лр╜гр╜╝р╝Л (female Wood-Ox) 1152 or 771 or тИТ1 Emperor Basil II (\"the Bulgar Slayer\") Year 1025 (MXXV) was a common year starting on Friday of the Julian calendar. Events [edit] January 21 тАУ Chifuru, daughter of powerful Japanese court official Fujiwara no Sanesuke (rival of Fujiwara no Michinaga) has her mogi ceremony. Sanesuke wants to make his daughter an imperial consort which causes the dislike of Empress Ishi (daughter of Michinaga) тАУ eventually Kampaku (Regent) Fujiwara no Yorimichi prevents it. [Unclear significance] February 25 тАУ (23 Dhu l-Hijja 415 AH) In the Fatimid Caliphate, Badr al-Dawla Nafidh leads a group of Egyptian soldiers and white slave soldiers from Cairo to end a black slave rebellion in the famine-stricken Egyptian capital, Fustat.[1] February тАУ In what was the Kingdom of Israel, Fath al-Qal\u0027i, the Fatimid Governor of Jerusalem, and Anushtakin al-Dizbari, the Governor of Palestine, make a successful assault on Ramla against Hassan ibn Mufarrij al-Jarrah, the leader of the Jarrahids of Syria. March 6 тАУ In the Duchy of Aquitaine in France, the Aquitanian barons and prelates meet at Maillezais, to discuss the claims by William the Fat, son of the Duke of Aquitaine Guillaume le Grand (William the Great) to rule the vacant throne of the Kingdom of Italy (primarily Lombardy and Tuscany) within the Holy Roman Empire.[2] The title is eventually claimed by Conrad the Salic. March 7 тАУ Herbert I, Count of Maine, is imprisoned at Saintes after being lured there by Fulk III, Count of Anjou, who had promised to reward Herbert with control of Saintes.[2] Herbert is held captive for two years before other nobles force his release. April 18 тАУ Boles┼Вaw I the Brave is crowned in Gniezno as the first King of Poland. He takes advantage of the interregnum in Germany (see 1024) and receives permission for his coronation from Pope John XIX; however, he dies 60 days later. May тАУ Ishoyahb IV, the unpopular Nicene Christian Patriarch of the Church of the East, dies in Baghdad after a five-year reign, leaving a vacancy that will not be filled until 1028.[3] June 17 тАУ Mieszko II Lambert becomes the second King of Poland after the sudden death of his father, King Boles┼Вaw I the Brave[4] September тАУ At the urging of Queen Constance of Arles, the three sons of King Robert II of France (\"the Pious\") revolt against their father тАУ Hugh Magnus (heir and co-king), Henry I and Robert I, Duke of Burgundy start a civil war over power. December 15 тАУ Byzantine Emperor Basil II (\"Bulgar Slayer\") dies in Constantinople after a 50-year reign. Never married, he is succeeded by his brother and co-emperor Constantine VIII, who becomes sole ruler of the Byzantine Empire. Constantine calls the Sicilian invasion off. Catapan Basil Boioannes diverts the Byzantine expeditionary force already assembled on Calabria, to join the siege of Capua. December 25 тАУ Mieszko II Lambert, son of Bolos┼Вaw I, is formally crowned as king of Poland by the Archbishop Hippolytus in Gniezno Cathedral. By place [edit] Africa [edit] Emir Al-Mu\u0027izz ibn Badis of the Zirid dynasty in Ifriqiya (modern Tunisia) attempts to retake Sicily but is unsuccessful.[5] Asia [edit] Srivijaya, a Buddhist kingdom based in Sumatra, is attacked by Emperor Rajendra I of the Chola dynasty of southern India in a dispute over trading rights in Southeast Asia. It survives but declines in importance. Completion and publishing of Avicenna\u0027s Canon of Medicine. Japanese Kampaku (Regent) Fujiwara no Yorimichi holds horse racing at his mansion; the emperor attends. [Unclear significance] Births [edit] Augu",
