    "content": "Jump to content Coordinates: 45┬░45тА▓0тА│N 101┬░12тА▓0тА│Wя╗┐ / я╗┐45.75000┬░N 101.20000┬░Wя╗┐ / 45.75000; -101.20000 From Wikipedia, the free encyclopedia Native American reservation in the United States \"Standing Rock\" redirects here. For other uses, see Standing Rock (disambiguation). For the protests, see Dakota Access Pipeline protests. Indian reservation in the United States Standing Rock Sioux Tribe of North \u0026 South Dakota Standing Rock Reservation ├Н┼Лya┼Л Wosl├бl H├б┼Л (Lakota) Indian reservation Seal as of August 2016 Anthem: \"Wapaha ki┼Л kekah\u0027boya┼Лhan\"[1] and \"Lakota Flag Song\" (used for some occasions) Standing Rock Reservation straddles the border between North and South Dakota Coordinates: 45┬░45тА▓0тА│N 101┬░12тА▓0тА│Wя╗┐ / я╗┐45.75000┬░N 101.20000┬░Wя╗┐ / 45.75000; -101.20000 Country United States State North Dakota South Dakota North Dakota Counties Sioux County South Dakota Counties Corson County Dewey County Ziebach County Area тАв Land 3,571.9 sq mi (9,251.2 km2) Population (2010)[2][3] тАв Total 8,217 (15,568 total enrollment) тАв Density 2.300/sq mi (0.8882/km2) Time zone UTC-5 (Central (CST)) тАв Summer (DST) UTC-4 (CST) ZIP code 58538 Area code 701 GDP $191.9 Million (2018) Website standingrock.org The Standing Rock Sioux Tribe of North \u0026 South Dakota controls the Standing Rock Reservation (Lakota: ├Н┼Лya┼Л Wosl├бl H├б┼Л), which straddles the border between North and South Dakota in the United States, and is inhabited by ethnic \"Hunkpapa and Sihasapa bands of Lakota Oyate and the Ihunktuwona and Pabaksa bands of the Dakota Oyate,\"[4] as well as the Hunkpatina Dakota (Lower Yanktonai).[5] The Ihanktonwana Dakota are the Upper Yanktonai, part of the collective of Wiciyena.[5] The sixth-largest Native American reservation in land area in the US, Standing Rock includes all of Sioux County, North Dakota, and all of Corson County, South Dakota, plus slivers of northern Dewey and Ziebach counties in South Dakota, along their northern county lines at Highway 20. The reservation has a land area of 3,571.9 square miles (9,251.2 km2), twice the size of the U.S. State of Delaware, and has a population of 8,217 as of the 2010 census.[2] There are 15,568 enrolled members of the tribe.[3] The largest communities on the reservation are Fort Yates, Cannon Ball (both located in Northern Standing Rock) and McLaughlin (located in Southern Standing Rock). History [edit] Together with the Hunkpapa and Sihasapa bands, the Standing Rock Sioux Tribe is part of what was known as the Great Sioux Nation. The peoples were highly decentralized. In 1868 the lands of the Great Sioux Nation were reduced in the Fort Laramie Treaty to the east side of the Missouri River and the state line of South Dakota in the west. The Black Hills, considered by the Sioux to be sacred land, are located in the center of territory awarded to the tribe. In 1874, in direct violation of the treaty, General George A. Custer and his 7th Cavalry entered the Black Hills and discovered gold, starting a gold rush. The United States government wanted to buy or rent the Black Hills from the Lakota people, but led by their spiritual leader Sitting Bull, they refused to sell or rent their lands. The Great Sioux War of 1876 was a series of battles and negotiations that occurred between 1876 and 1877, with the Lakota Sioux and Northern Cheyenne warring against the United States. Among the many battles and skirmishes of the war was the Battle of the Little Bighorn, often known as Custer\u0027s Last Stand, the most storied of the many encounters between the U.S. army and mounted Plains Native Americans. It was an overwhelming Native American victory. The U.S. with its superior resources was soon able to force the Native Americans to surrender, primarily by attacking and destroying their encampments and property. The Agreement of 1877 (19 Stat. 254, enacted February 28, 1877) officially annexed Sioux land and permanently established Native American reservations. Under the Agreement of 1877 the U.S. government took the Black Hills from the Sioux Nation.[6] In February 1890, the United States government broke another Lakota treaty by breaking up the Great Sioux Reservation, an area that formerly encompassed the majority of the state. It reduced it and divided it into five smaller reservations.[7] The government was accommodating white homesteaders from the eastern United States; in addition, it intended to \"break up tribal relationships\" and \"conform Indians to the white man\u0027s ways, peaceably if they will, or forcibly if they must\".[8] On the reduced reservations, the government allocated family units on 320-acre (1.3 km2) plots for individual households. Although the Lakota were historically a nomadic people living in tipis, and their Plains Native American culture was based strongly upon buffalo and horse culture, they were expected to farm and raise livestock. With the goal of assimilation, in the late 19th and early 20th centuries, they were forced to send their children to boarding schools; the schools taugh",
