    "content": "Ir al contenido De Wikipedia, la enciclopedia libre Bienvenidos a Wikipedia, la enciclopedia de contenido libre que todos pueden editar. Buscar en 2 080 490 art├нculos 2 080 490 art├нculos en espa├▒ol. Caf├й ┬┐C├│mo colaborar? Primeros pasos Ayuda Contacto Art├нculo destacado Coldplay Actuaci├│n en el Estadio de Wembley en 2025. Coldplay es una banda brit├бnica de rock formada en Londres en 1997. Est├б compuesta por el vocalista y pianista Chris Martin, el guitarrista Jonny Buckland, el bajista Guy Berryman y el baterista Will Champion, adem├бs de Phil Harvey como su m├бnager. Sus integrantes se conocieron en el University College de Londres. Firmaron con Parlophone en 1999 y lanzaron su primer ├бlbum, Parachutes (2000), que incluy├│ el sencillo ┬лYellow┬╗, con el que alcanzaron la fama. Su siguiente trabajo, A Rush of Blood to the Head (2002), logr├│ tambi├йn una gran acogida. X\u0026Y (2005) cerr├│ lo que la banda consideraba una trilog├нa, y su sucesor, Viva la Vida or Death and All His Friends (2008), gan├│ el Grammy al mejor ├бlbum de rock. Adem├бs, ┬лViva la vida┬╗ fue la primera canci├│n de un grupo brit├бnico en alcanzar de manera simult├бnea el n├║mero uno en Estados Unidos y el Reino Unido en el siglo XXI. Coldplay ampli├│ su repertorio con los discos Mylo Xyloto (2011), Ghost Stories (2014), A Head Full of Dreams (2015), Everyday Life (2019), Music of the Spheres (2021) y Moon Music (2024), en los que incorporaron influencias de la m├║sica electr├│nica, el R\u0026B, el ambient, la m├║sica disco, el funk, el g├│spel, el blues y el rock progresivo. Con m├бs de 160 millones de ├бlbumes vendidos en todo el mundo, Coldplay figura entre los artistas m├бs exitosos de la historia. Fue la primera banda en alcanzar 90 millones de oyentes mensuales en Spotify y la cadena Fuse los incluy├│ entre los m├║sicos m├бs premiados, al mantener el r├йcord de mayor n├║mero de premios Brit obtenidos por un grupo. En el Reino Unido, cuenta con tres de los cincuenta ├бlbumes m├бs vendidos, la mayor cantidad de discos que alcanzaron el primer puesto en la lista UK Albums Chart sin descender de las diez primeras posiciones y el reconocimiento como el conjunto m├бs reproducido del siglo XXI en los medios brit├бnicos. Dos de sus actuaciones en directo figuran entre las m├бs taquilleras y concurridas de todos los tiempos. La Industria Fonogr├бfica Brit├бnica los describi├│ como una de las bandas ┬лm├бs influyentes y pioneras┬╗ del mundo, mientras que el Sal├│n de la Fama del Rock and Roll incluy├│ A Rush of Blood to the Head en su lista de los 200 discos definitivos y a ┬лYellow┬╗ en la exhibici├│n Songs That Shaped Rock and Roll. Adem├бs de su carrera musical, el grupo ha destacado por su labor filantr├│pica, pol├нtica y activista. Sin embargo, pese a sus indiscutibles ├йxitos, ciertos sectores de la cr├нtica han puesto en entredicho su legado como icono cultural. Leer Todos los art├нculos destacados Candidatos Anteriores: Batalla de Santa M├│nica Fibrosis qu├нstica Fortificaciones de Pamplona Art├нculo bueno Sarcoscypha coccinea Sarcoscypha coccinea Sarcoscypha coccinea, com├║nmente conocida como copica escarlata, es una especie de hongo de la familia Sarcoscyphaceae, del orden Pezizales. El hongo puede encontrarse en todos los continentes excepto en la Ant├бrtida. Es la especie tipo del g├йnero Sarcoscypha, la cual ha sido conocida con muchos nombres desde su primera aparici├│n en la literatura cient├нfica en 1772. El an├бlisis filogen├йtico indica que la especie estar├нa muy relacionada con otras de Sarcoscypha que contienen numerosas gotitas de aceite en sus esporas, como la especie S. macaronesica, de las islas del Atl├бntico Norte. Leer Todos los art├нculos buenos Candidatos Anteriores: Lynyrd Skynyrd Deep Purple in Rock Sitta carolinensis Recurso del d├нa Hongo oronja Hongo oronja El oronja (Amanita caesarea) com├║nmente conocida como el hongo de C├йsar, es un hongo comestible muy apreciado del g├йnero Amanita, originario del sur de Europa y el norte de ├Бfrica. Su cuerpo fruct├нfero se desarrolla entre el verano y oto├▒o, aunque crece mayormente en lugares con tormentas abundantes. Suele localizarse en regiones de clima mediterr├бneo en Europa. Muestra preferencia por los terrenos sil├нceos y bosques aclarados, encontr├бndose principalmente bajo alcornoques, encinas, robles, casta├▒os y, ocasionalmente, con├нferas. Archivo Actualidad Guerras y conflictos: Generaci├│n Z (varios pa├нses), Estados Unidos-Venezuela, Gaza-Israel, Rusia-Ucrania 14 de diciembre: Tiroteo en Bondi Beach 14 de diciembre: Segunda vuelta de las elecciones presidenciales de Chile 14 de diciembre: M├бximo de las Gem├нnidas 12-21 de diciembre: Vuelta a Costa Rica 10-17 de diciembre: Copa Intercontinental de la FIFA 9-14 de diciembre: Campeonato Mundial de Clubes de Voleibol Femenino 26 de noviembre-14 de diciembre: Campeonato Mundial de Balonmano Femenino Fallecimientos 14 de diciembre: Kshamenk, orca argentina (32-34) 14 de diciembre: Eva Giberti, psic├│loga y psicoanalista argentina (96) 13 de diciembre: Bruno Baveni, futbolista y entrenador italia",
