    "url": "https://en.wikipedia.org/wiki/Southern_Pacific_Railroad",
    "title": "Southern Pacific Railroad - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia United States Class I railroad (1865тАУ1996) \"Southern Pacific\" redirects here. For other uses, see Southern Pacific (disambiguation). \"SPRR\" redirects here. For the proposed railroad in Pennsylvania, see South Pennsylvania Railroad. Southern Pacific Railroad SP system map (before the 1988 DRGW merger) SP #8912 leads a freight train in Palm Springs, California, in February 1981. Overview Headquarters San Francisco, California Founders William Tell Coleman Timothy Guy Phelps William Rosecrans Leland Stanford Reporting mark SP Locale Arizona, Arkansas, California, Colorado, Illinois, Kansas, Louisiana, Missouri, Nevada, New Mexico, Oklahoma, Oregon, Tennessee, Texas, Utah Dates of operation 1865тАУ1996 Predecessor Central Pacific Railroad Successors Santa Fe Pacific Corporation Union Pacific Railroad Technical Track gauge 4 ft 8+1тБД2 in (1,435 mm) standard gauge with some 3 ft (914 mm) narrow gauge branches The Southern Pacific (reporting mark SP) (or Espee from the railroad initials) was an American Class I railroad network that existed from 1865 to 1996 and operated largely in the Western United States. The system was operated by various companies under the names Southern Pacific Railroad, Southern Pacific Company and Southern Pacific Transportation Company. The original Southern Pacific began in 1865 as a land holding company. The last incarnation of the Southern Pacific, the Southern Pacific Transportation Company, was founded in 1969 and assumed control of the Southern Pacific system. The Southern Pacific Transportation Company was acquired in 1996 by the Union Pacific Corporation and merged with their Union Pacific Railroad. The Southern Pacific legacy founded hospitals in San Francisco, Tucson, and Houston. In the 1970s, it also founded a telecommunications network with a state-of-the-art microwave and fiber optic backbone. This telecommunications network became part of Sprint, a company whose name came from the acronym for Southern Pacific Railroad Internal Networking Telephony.[1] History [edit] For broader coverage of this topic, see History of the Southern Pacific. \"Mr. Maguire\u0027s Stand on the Railroad Question,\" a caricature of Democratic gubernatorial candidate James G. Maguire published in the San Francisco Examiner depicting him triumphant over the political forces of the Southern Pacific, October 8, 1898 The original Southern Pacific Railroad was founded in San Francisco in 1865, by a group of businessmen led by Timothy Phelps with the aim of building a rail connection between San Francisco and San Diego, California. The company was purchased in September 1868 by a group of businessmen known as the Big Four: Charles Crocker, Leland Stanford, Mark Hopkins, Jr. and C. P. Huntington. (The Big Four had, in 1861, created the Central Pacific Railroad (CPRR)[2]) It later acquired the routes of the Central Pacific Railroad in 1885 through leasing.[3][4][5] By 1900, the Southern Pacific system was a major railroad system incorporating many smaller companies, such as the Texas and New Orleans Railroad and Morgan\u0027s Louisiana and Texas Railroad. It extended from New Orleans through Texas to El Paso, across New Mexico and through Tucson, to Los Angeles, through most of California, including San Francisco and Sacramento. Central Pacific lines extended east across Nevada to Ogden, Utah, and reached north through Oregon to Portland. Other subsidiaries eventually included the St. Louis Southwestern Railway (Cotton Belt, reporting marks SSW), El Paso and Southwestern Railroad, the Northwestern Pacific Railroad at 328 miles (528 km), the 1,331-mile (2,142 km) Southern Pacific Railroad of Mexico, and a variety of 3 ft (914 mm) narrow-gauge routes. The company was headquartered in the Flood Building in San Francisco\u0027s downtown shopping district in 1907. Ten years later, they moved into the historic 11-story, 65-metre (213 ft) Southern Pacific Building, also known as \"The Landmark\", located at One Market Street on the Embarcadero whose construction started in 1916.[6][7] At its completion, the building\u0027s first floor was devoted to retail except for the portion facing the rear courtyard (opening to Mission Street), which was reserved for Southern Pacific.[8] SP rented the second floor to a tenant, but occupied floors three through ten with various offices.[8] For nearly a century, the building was topped with a large sign emblazoned with a gothic \"S┬╖P\" marking the company\u0027s San Francisco roots.[9] The SP was known for its mammoth back shops at Sacramento, California, which was one of the few in the country equipped to design and build locomotives on a large scale. Sacramento was among the top ten largest shops in the US, occupying 200 acres of land with dozens of buildings and an average employment of 3,000, peaking at 7,000 during World War II. Other major shop sites were located at Ogden, Utah; Houston, Texas; and Algiers, New Orleans. After the 1906 earthquake destr",
