    "url": "https://en.wikipedia.org/wiki/Hunkpapa",
    "title": "Hunkpapa - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Traditional tribal grouping within the Lakota people This article is about the Hunkpapa branch of the Lakota Native American tribe. For the 1989 album by Throwing Muses, see Hunkpapa (album). This article needs additional citations for verification. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Find sources: \"Hunkpapa\" тАУ news ┬╖ newspapers ┬╖ books ┬╖ scholar ┬╖ JSTOR (December 2009) (Learn how and when to remove this message) Walking Shooter (Wah-Koo-Ta-Mon-Ih), 1872 Tribal Delegations to the Federal Government The Hunkpapa (Lakota: H├║┼Лkpap╚Яa) are a Native American group, one of the seven council fires of the Lakota tribe. The name H├║┼Лkpap╚Яa is a Lakota word, meaning \u0027Head of the Circle\u0027 (at one time, the tribe\u0027s name was represented in European-American records as Honkpapa). By tradition, the H├║┼Лkpap╚Яa set up their lodges at the entryway to the circle of the Great Council when the Sioux met in convocation.[1] They speak Lak╚Я├│ta, one of the three dialects of the Sioux language. History in the 19th century [edit] Hunkpapa Lakota shield, 1885, made by Joseph No Two Horns (He Nupa Wanica), Metropolitan Museum of Art Seven hundred and fifty mounted Yankton, Yanktonai and Lakota joined six companies of the Sixth Infantry and 80 fur trappers in an attack on an Arikara Indian village at Grand River (now South Dakota) in August 1823, named the Arikara War. Members of the Lakota, a part of them \"Ankpapat\", were the first Native Americans to fight in the American Indian Wars alongside US forces west of the Missouri.[2] They may have formed as a tribe within the Lakota relatively recently, as the first mention of the Hunkpapa in European-American historical records was from a treaty of 1825. By signing the 1825 treaty, the Hunkpapa and the United States committed themselves to keep up the \"friendship which has heretofore existed\". With their x-mark, the chiefs also recognized the supremacy of the United States.[3] It is not certain whether they really understood the text in the document. The US representatives gave a medal to Little White Bear, who they understood was the principal Hunkpapa chief; they did not realize how decentralized Native American authority was.[4] With the Indian Vaccination Act of 1832, the United States assumed responsibility for the inoculation of the Indians against smallpox. Some visiting Hunkpapa may have benefitted from Dr. M. Martin\u0027s inoculation of about 900 southern Lakota (no divisions named) at the head of Medicine Creek that autumn.[5] When smallpox struck in 1837, it hit the Hunkpapa as the northernmost Lakota division. The loss, however, may have been fewer than one hundred people.[6] Overall, the Hunkpapa seem to have suffered less from new diseases than many other tribes did.[7] The boundaries for the Lakota Indian territory were defined in the general peace treaty negotiated near Fort Laramie in the summer of 1851. Leaders of eight different tribes, often at odds with each other and each claiming large territories, signed the treaty. The United States was a ninth party to it. The Crow Indian territory included a tract of land north of the Yellowstone, while the Little Bighorn River ran through the heartland of the Crow country (now Montana). The treaty defines the land of the Arikara, the Hidatsa and the Mandan as a mutual area north of Heart River, partly encircled by the Missouri (now North Dakota).[8] Soon enough the Hunkpapa and other Sioux attacked the Arikara and the two other so-called village tribes, just as they had done in the past. By 1854, these three smallpox-devastated tribes called for protection from the U.S. Army, and they would repeatedly do so almost to the end of inter-tribal warfare.[9] Eventually the Hunkpapa and other Lakota took control of the three tribes\u0027 area north of Heart River, forcing the village people to live in Like a Fishhook Village outside their treaty land. The Lakota were largely in control of the occupied area to 1876тАУ1877.[10] The United States Army General Warren estimated the population of the Hunkpapa Lakota at about 2920 in 1855. He described their territory as ranging \"from the Big Cheyenne up to the Yellowstone, and west to the Black Hills. He states that they formerly intermarried extensively with the Cheyenne.\" He noted that they raided settlers along the Platte River.[1] In addition to dealing with warfare, they suffered considerable losses due to contact with Europeans and contracting of Eurasian infectious diseases to which they had no immunity. The Hunkpapa gave some of their remote relatives among the Santee Sioux armed support during a large-scale battle near Killdeer Mountain in 1864 with U.S. troops led by General A. Sully.[11] The Great Sioux Reservation was established with a new treaty in 1868.[12] The Lakota agreed to the construction of \"any railroad\" outside their reservation. The United St",
