    "content": "Jump to content From Wikipedia, the free encyclopedia American lawyer (1942тАУ2025) For American professor of classics, see Gerald Michael Browne. Gerald Michael Brown (November 3, 1942 тАУ October 6, 2025) was an American gaming regulator in New Jersey who became a lawyer for the gaming industry, and was the chief executive officer of Foxwoods Resort Casino. Early life and education [edit] Born on November 3, 1942, in Orange, New Jersey, Brown graduated from St. Benedict\u0027s Preparatory School, before earning degrees at Franciscan University of Steubenville and the Seton Hall University School of Law, later serving in the United States Army during the Vietnam War.[1] Career [edit] He began his legal career in 1970 as an assistant prosecutor in Essex County, New Jersey.[2] As assistant state attorney general in a 1980 case, Brown was the lead prosecutor and obtained the convictions of four members of the Genovese crime family on charges including extortion, loan-sharking and robbery, saying that the verdict demonstrated that the Mafia isn\u0027t merely \"a figment of Hollywood\u0027s imagination.\"[3] One of the defendants gave him credit for his legal skills, telling Brown to reach out \u0027If you ever decide to come over to the other side.\"[4] At a 1979 hearing of the New Jersey Casino Control Commission, where Resorts International was seeking approval of the first permanent casino license in Atlantic City, New Jersey, he was asked by a commissioner if the casino operator or its management had any connection to organized crime, to which Brown responded \"not at the present time, no\".[5] He served from 1980 to 1982 as director of the New Jersey Division of Gaming Enforcement, which oversees the integrity of the state\u0027s casinos and gambling operations, after which he operated a law practice in Atlantic City that focused on gambling regulation.[2][6] In 1993, he was hired by the Mashantucket Pequot Tribe to develop and expand what was then known as Foxwoods High Stakes Bingo \u0026 Casino on their reservation in Ledyard, Connecticut, expanding it into the Foxwoods Resort Casino.[7] With the state of Connecticut facing financial challenges, he was able to make a deal through the offices of governor Lowell P. Weicker under which the casino would gain authorization to install slot machines at its casino in exchange for the state given 25% of the take, with $100 million a year in revenue guaranteed on an annual basis.[4] The addition of slot machines helped fund a major expansion announced in 1993, that would add a combination 3,000-seat bingo hall / boxing arena / concert hall covering 55,000 square feet (5,100 m2) that would make Foxwoods the largest casino in the country.[8] A resident of Sea Girt, New Jersey, he earned $1.5 million a year while he ran what was considered one of the country\u0027s most profitable casinos, before leaving in 1997 in a dispute with the casino\u0027s owners related to a perceived conflict of interest that arose after he bought stock in one of the casino\u0027s vendors.[4][9] As president and part owner of Manhattan Cruises in 1998, his short-lived company offered overnight casino cruises to nowhere from New York City aboard the Edinburgh Castle.[1][10] Death [edit] Brown died in Fort Lauderdale, Florida, on October 6, 2025, at the age of 82.[11][12] References [edit] ^ a b Roberts, Sam. \"G. Michael Brown, Who Regulated and Then Ran Casinos, Dies at 82\", The New York Times, October 23, 2025. Accessed October 25, 2025. \"Gerard Michael Brown, the youngest of five siblings, was born on Nov. 3, 1942, in Orange, N.J. His father, Edmund, was a real estate agent. His mother, Mae (Conroy) Brown, managed the home. After attending St. BenedictтАЩs Preparatory School in Newark, Mr. Brown graduated from Franciscan University of Steubenville in Ohio with a bachelorтАЩs degree in history in 1964 and received a law degree in 1967 from Seton Hall Law School in New Jersey.\" ^ a b Liberman, Si. \"New Jersey Q \u0026 A: G. Michael Brown; Helping Casinos to Acquire Licenses\", The New York Times, November 28, 1993. Accessed October 25, 2025. \"In 1982, Mr. Brown resigned as the state\u0027s $70,000-a-year director of the division of gaming enforcement, opening law offices in Atlantic City and in his hometown here.... He developed his expertise during 12 years of public service, rising from Assistant Essex County Prosecutor in 1970 to the state\u0027s Chief Trial Attorney and deputy director of operations of the division of criminal justice before becoming director of the division of gaming enforcement in 1980.\" ^ Waldron, Martin. \"4 Are Convicted of Running Criminal Syndicate in Jersey; Sentencing Set for August\", The New York Times, June 21, 1980. Accessed October 25, 2025. \"A state jury today convicted four New Jersey men of conspiracy after a three-month trial in which prosecutors described them as operators of a criminal cartel that furthered murder, extortion, gambling and loan-sharking. The prosecutor, Assistant Attorney General G. Michael Brown, said the c",
