    "content": "Jump to content Coordinates: 27┬░41тА▓44тА│S 153┬░14тА▓24тА│Eя╗┐ / я╗┐27.69556┬░S 153.24000┬░Eя╗┐ / -27.69556; 153.24000 From Wikipedia, the free encyclopedia River in Queensland, Australia For other uses, see Albert River. Albert Albert River at Stapylton, 2014 Location of Albert River river mouth in Queensland Etymology Prince Albert of Saxe-Coburg and Gotha Location Country Australia State Queensland Region South East Queensland Local government areas Scenic Rim Region, City of Gold Coast Physical characteristics Source McPherson Range, Great Dividing Range Source confluence Right and Left Branches of the Albert River тАв location below Neglected Mountain тАв coordinates 28┬░12тА▓44тА│S 153┬░2тА▓36тА│Eя╗┐ / я╗┐28.21222┬░S 153.04333┬░Eя╗┐ / -28.21222; 153.04333 тАв elevation 184 m (604 ft) Mouth confluence with the Logan River тАв location Alberton тАв coordinates 27┬░41тА▓44тА│S 153┬░14тА▓24тА│Eя╗┐ / я╗┐27.69556┬░S 153.24000┬░Eя╗┐ / -27.69556; 153.24000 тАв elevation 3 m (9.8 ft) Length 102 km (63 mi) Basin size 782 km2 (302 sq mi) Basin features River system Logan River [1][2] The Albert River is a perennial river in the South East region of Queensland, Australia. Its catchment lies within the Gold Coast and Scenic Rim Region local government areas and covers an area of 782 square kilometres (302 sq mi). The river provides potable water for the town of Beaudesert. Course and features [edit] Formed by the confluence of the Right and Left Branches of the river that begin in the Lamington National Park and drain the northern slopes of the Border Ranges within the Great Dividing Range, the Albert River rises below Neglected Mountain and east of the settlement of Hillview. The river flows generally north, joined by six minor tributaries before reaching its confluence with the Logan River between Alberton and Eagleby. From there the Logan flows a further 12 kilometres (7.5 mi) before entering Moreton Bay.[3] The Albert River catchment is bounded by the McPherson Range to the south, the Beechmont Range in the east and the Jinbroken Range and Birnam Range to the west.[4] The river\u0027s upper catchment is heavily influenced by the national parks of Tamborine, Main Range and the Lamington Plateau, and numerous local government-owned reserves and conservation areas,[5] that comprise part of the Shield Volcano Group of the UNESCO World Heritage Site Gondwana Rainforests of Australia. Tributaries of the Albert River include the Stockyard Creek, Duck Creek, Kerry Creek, Cainbable Creek, Canungra Creek and Bidaddaba Creek.[1] The Albert River is crossed by the Pacific Motorway, the Old Pacific Highway, and the Gold Coast railway line at Yatala.[1] History [edit] Yugembah (also known as Yugumbir, Jugambel, Jugambeir, Jugumbir, Jukam, Jukamba) is one of the Australian Aboriginal languages in areas that include the Albert River, Gold Coast, Logan, Scenic Rim, Beaudesert, Beenleigh, Coolangatta, Coomera, Logan River, Pimpama, Tamborine and Tweed River Valley, within the local government boundaries of the City of Gold Coast, City of Logan, Scenic Rim Regional Council and the Tweed River Valley.[6] Mununjali (also known as Mananjahli, Manaldjahli and Manandjali) is a dialect of the Yugambeh language. The Mununjali language area includes landscape within the local government boundaries of the Scenic Rim and Beaudesert Shire Councils.[7] The river was named by Robert Dixon[8] in honour of Prince Albert of Saxe-Coburg and Gotha.[9] A rise in the Albert River would see access to O\u0027Reilly\u0027s Rainforest Retreat difficult or impossible during its early years of operation.[10] Floods have been recorded on the Albert River in 1925, 1947, 1972, 1976, 1980, 1989, 2013 and 2017 (Cyclone Debbie).[11][12] In 1884, the S.S. Walrus ran aground on the bank of the river.[13] The vessel had been used as a floating sugar mill and distillery. Proposed dam [edit] In 1989, the Goss Government rejected a proposal to build Wolffdene Dam on the Albert River. Later, a dam near Glendower Homestead was once planned in a Queensland Government water strategy report from 1990. The option was discarded after it was revealed the site was too costly to build a dam for the amount of water it would have provided.[14] Environmental concerns [edit] This section needs additional citations for verification. Please help improve this article by adding citations to reliable sources in this section. Unsourced material may be challenged and removed. (September 2015) (Learn how and when to remove this message) The water quality of the Albert River remains in relatively good condition until it merges with the Logan River where the quality declines. Residential and industry development and land clearing in the catchment have deteriorated the water quality of the Albert River, particularly in its lower reaches. Key environmental issues that face the catchment are rapid population increase and development; altered flow patterns of the creek causing active erosion; deteriorating water quality; increased noise and vehicle movements; waste dispo",
