    "content": "Jump to content From Wikipedia, the free encyclopedia Imperial Japan\u0027s use of the Shinto religion Empire of Japan\u0027s 50 sen banknote, featuring Yasukuni Shrine Part of a series on Shinto Beliefs Animism/Animatism Kami List of deities Mythology Polytheism Sacred objects Sects and schools Major kami Amaterasu Ame-no-Uzume Inari Izanagi Izanami Susanoo Tsukuyomi Important literature Kojiki (c.тАЙ711 CE) Nihon Shoki (720 CE) Fudoki (713тАУ723 CE) Shoku Nihongi (797 CE) Kogo Sh┼лi (807 CE) Kujiki (807тАУ936 CE) Engishiki (927 CE) Shinto shrines Association of Shinto Shrines Ichinomiya List of Shinto shrines Modern system of ranked Shinto shrines Shinto architecture Twenty-Two Shrines Practices Festivals Shinto priest Miko Music Ritual dance Ritual incantations Ritual purification See also Edo neo-Confucianism Glossary of Shinto History Kokugaku Ko-Shint┼Н Mythical creatures Nippon Kaigi Religion in Japan Secular Shrine Theory State Shinto Syncretism of Shinto and Buddhism Religion portal v t e State Shint┼Н (хЫ╜хо╢чеЮщБУ or хЬЛхо╢чеЮщБУ, Kokka Shint┼Н) was Imperial Japan\u0027s ideological use of the Japanese folk religion and traditions of Shinto.[1]:тАК547тАК The state exercised control of shrine finances and training regimes for priests[2][3]:тАК59тАК[4]:тАК120тАК to strongly encourage Shinto practices that emphasized the Emperor as a divine being.[5]:тАК8тАК The State Shinto ideology emerged at the start of the Meiji era, after government officials defined freedom of religion within the Meiji Constitution.[6]:тАК115тАК Imperial scholars believed Shinto reflected the historical fact of the Emperor\u0027s divine origins rather than a religious belief, and argued that it should enjoy a privileged relationship with the Japanese state.[5]:тАК8тАК[3]:тАК59тАК The government argued that Shinto was a non-religious moral tradition and patriotic practice, to give the impression that they supported religious freedom.[3]:тАК59тАК[4]:тАК120тАК Though early Meiji-era attempts to unite Shinto and the state failed,[6]:тАК51тАК this non-religious concept of ideological Shinto was incorporated into state bureaucracy.[7]:тАК547тАК[8] Shrines were defined as patriotic, not religious, institutions, which served state purposes such as honoring the war dead;[6]:тАК91тАК this is known as Secular Shrine Theory.[9] The state also integrated local shrines into political functions, occasionally spurring local opposition and resentment.[4]:тАК120тАК With fewer shrines financed by the state, nearly 80,000 closed or merged with neighbors.[6]:тАК98тАК[7]:тАК118тАК Many shrines and shrine organizations began to independently embrace these state directives, regardless of funding.[7]:тАК114тАК By 1940, Shinto priests risked persecution for performing traditionally \"religious\" Shinto ceremonies.[6]:тАК25тАК[10]:тАК699тАК Imperial Japan did not draw a distinction between ideological Shinto and traditional Shinto.[7]:тАК100тАК US military leaders introduced the term \"State Shinto\" to differentiate the state\u0027s ideology from traditional Shinto practices[5]:тАК38тАК in the 1945 Shinto Directive.[5]:тАК38тАК That decree established Shinto as a religion, and banned further ideological uses of Shinto by the state.[10]:тАК703тАК Controversy continues to surround the use of Shinto symbols in state functions.[2]:тАК428тАК[10]:тАК706тАК[11] Origins of the term [edit] Shinto is a blend of indigenous Japanese folk practices, beliefs, court manners, and spirit-worship which dates back to at least 600 CE.[7]:тАК99тАК These beliefs were unified as \"Shinto\" during the Meiji era (1868тАУ1912),[6]:тАК4тАК[12] though the Chronicles of Japan (цЧецЬмцЫ╕ч┤А, Nihon Shoki) first referenced the term in the eighth century. Shinto has no fixed doctrines or founder, but draws instead from creation myths described in books such as the Kojiki.[13]:тАК9тАК The December 15, 1945 \"Shinto Directive\" of the United States General Headquarters introduced the \"State Shinto\" distinction when it began governing Japan after the Second World War. The Shinto Directive (officially the \"Abolition of Governmental Sponsorship, Support, Perpetuation, Control and Dissemination of State Shinto\") defined State Shinto as \"that branch of Shinto (Kokka Shinto or Jinja Shinto) which, by official acts of the Japanese government, has been differentiated from the religion of Sect Shinto (Shuha Shinto or Kyoha Shinto) and has been classified a non-religious national cult.\"[5]:тАК41тАУ42тАК[14] The \"State Shinto\" term was thus used to categorize and abolish Imperial Japanese practices that relied on Shinto to support nationalistic ideology.[6]:тАК133тАК[7]:тАК97тАК By declining to ban Shinto practices outright, Japan\u0027s post-war constitution was able to preserve full freedom of religion.[6]:тАК133тАК Definitions [edit] This 1878 engraving by Toyohara Chikanobu (1838тАУ1912) visually presents the central tenet of State Shinto (1871тАУ1946). This Shinto variant asserted and promoted belief in the divinity of the Emperor, which arose from a genealogical family tree extending back to the first emperor and to the most important deities of Japanese mythology. The definition of State S",
