    "content": "Jump to content From Wikipedia, the free encyclopedia Indian independence activist (1875тАУ1950) \"Sardar Patel\" redirects here. For the honorific prefix, see Sardar. Sardar Vallabhbhai Patel Patel in 1949 1st Deputy Prime Minister of India In office 15 August 1947 тАУ 15 December 1950 President Rajendra Prasad Governors General Louis Mountbatten C. Rajagopalachari Prime Minister Jawaharlal Nehru Preceded by Position established Succeeded by Morarji Desai Union Minister of Home Affairs In office 15 August 1947 тАУ 15 December 1950 President Rajendra Prasad Governors General Louis Mountbatten C. Rajagopalachari Prime Minister Jawaharlal Nehru Preceded by Position established Succeeded by C. Rajagopalachari Personal details Born Vallabhbhai Jhaverbhai Patel (1875-10-31)31 October 1875 Nadiad, Bombay Presidency, British India (present-day Gujarat, India) Died 15 December 1950(1950-12-15) (aged 75) Bombay, Bombay State, India (present-day Mumbai, Maharashtra, India) Party Indian National Congress Spouse Jhaverben Patel (m. 1893; died 1909) Children Maniben Dahyabhai Parents Jhaverbhai Patel (father) Ladba Patel (mother) Relatives Vithalbhai Patel (brother) Alma mater Middle Temple Vallabhbhai Jhaverbhai Patel (Gujarati: [╩Л╔Щl╦Р╔Щb╩▒.b╩▒╔Сi d╩Т╩▒╔Щ╩Лe╔╛b╩▒╔Сi p╔Щ╩Иel]; 31 October 1875 тАУ 15 December 1950), commonly known as Sardar Vallabhbhai Patel,[a] was an Indian independence activist and statesman who served as the first Deputy Prime Minister and Home Minister of India from 1947 to 1950. He was a senior leader of the Indian National Congress, who played a significant role in the Indian independence movement and India\u0027s political integration.[1] In Persian and elsewhere, he was often called Sardar meaning \"chief\". He acted as the Home Minister during the political integration of India and the Indo-Pakistani War of 1947.[2] Patel was born in Nadiad city (present-day Kheda district, Gujarat) and raised in the countryside of the state of Gujarat.[3] He was a successful lawyer. One of Mahatma Gandhi\u0027s earliest political lieutenants, he organised peasants from Kheda, Borsad and Bardoli in Gujarat in non-violent civil disobedience against the British Raj, becoming one of the most influential leaders in Gujarat. He was appointed as the 49th President of Indian National Congress. Under the chairmanship of Patel \"Fundamental Rights and Economic Policy\" resolution was passed by the Congress. Patel\u0027s position at the highest level in the Congress was largely connected with his role from 1934 onwards (when the Congress abandoned its boycott of elections) in the party organisation. Based at an apartment in Bombay, he became the Congress\u0027s main fundraiser and chairman of its Central Parliamentary Board, playing the leading role in selecting and financing candidates for the 1934 elections to the Central Legislative Assembly in New Delhi and for the provincial elections of 1936.[4] While promoting the Quit India Movement, Patel made a climactic speech to more than 100,000 people gathered at Gowalia Tank in Bombay on 7 August 1942. Historians believe that Patel\u0027s speech was instrumental in electrifying nationalists, who up to then had been sceptical of the proposed rebellion. Patel\u0027s organising work in this period is credited by historians with ensuring the success of the rebellion across India.[5] As the first Home Minister and Deputy Prime Minister of India, Patel organised relief efforts for partition refugees fleeing to Punjab and Delhi from Pakistan and worked to restore peace. Besides those provinces that had been under direct British rule, approximately 565 self-governing princely states had been released from British suzerainty by the Indian Independence Act 1947 (10 \u0026 11 Geo. 6. c. 30). Patel, together with Jawaharlal Nehru and Louis Mountbatten persuaded almost every princely state to accede to India.[6] Patel\u0027s commitment to national integration in the newly independent country earned him the sobriquet \"Iron Man of India\".[7] He is also remembered as the \"patron saint of India\u0027s civil servants\" for playing a pioneering role in establishing the modern All India Services system. The Statue of Unity, the world\u0027s tallest statue which was erected by the Indian government at a cost of US$420 million, was dedicated to him on 31 October 2018 and is approximately 182 metres (597 ft) in height.[8] Early life and background [edit] Vallabhbhai Jhaverbhai Patel,[9][10] one of the six children of Jhaverbhai Patel and Ladba, was born in Nadiad, Gujarat.[11] Patel\u0027s date of birth was never officially recorded; Patel entered it as 31 October on his matriculation examination papers.[12] He belonged to the Patidars, specifically the Leva Patel community of Central Gujarat; although after his fame, both Leva Patel and Kadava Patidar have claimed him as one of their own.[13] Patel travelled to attend schools in Nadiad, Petlad, and Borsad, living self-sufficiently with other boys. He reputedly cultivated a stoic character. A popular anecdote recounts that he l",
