    "content": "Jump to content From Wikipedia, the free encyclopedia Free licensed works in any field For understanding how free content works on Wikipedia, see Wikipedia:Free content. The logo on the computer screen is a Creative Commons license, while the paper explains, in Khmer, that the image is open content. Free content, libre content, libre information, or free information is any kind of creative work,[1] such as a work of art, a book,[2] a software program,[3][4] or any other creative content for which there are very minimal copyright and other legal limitations on usage, modification and distribution. These are works or expressions which can be freely studied, applied, copied and modified by anyone for any purpose[5][6] including, in some cases, commercial purposes. Free content encompasses all works in the public domain and also those copyrighted works whose licenses honor and uphold the definition of free cultural work.[7] In most countries, the Berne Convention grants copyright holders control over their creations by default.[8] Therefore, copyrighted content must be explicitly declared free by the authors, which is usually accomplished by referencing or including licensing statements from within the work.[9] The right to reuse such a work is granted by the authors in a license known as a free license, a free distribution license, or an open license, depending on the rights assigned.[9] These freedoms given to users in the reuse of works (that is, the right to freely use, study, modify or distribute these works, possibly also for commercial purposes) are often associated with obligations (to cite the original author, to maintain the original license of the reused content) or restrictions (excluding commercial use, banning certain media) chosen by the author.[10] There are a number of standardized licenses offering varied options that allow authors to choose the type of reuse of their work that they wish to authorize or forbid.[11] Definition There are a number of different definitions of free content in regular use. Legally, however, free content is very similar to open content. An analogy is a use of the rival terms free software and open-source, which describe ideological differences rather than legal ones.[12][13] The term Open Source, by contrast, sought to encompass them all in one movement.[14][15] For instance, the Open Knowledge Foundation\u0027s Open Definition describes \"open\" as synonymous with the definition of free in the \"Definition of Free Cultural Works\" (as also in the Open Source Definition and Free Software Definition).[16] For such free/open content both movements recommend the same three Creative Commons licenses, the CC BY, CC BY-SA, and CC0.[17][18][19][20] Legal background Copyright Main article: Copyright Copyright symbol Copyright is a legal concept, which gives the author or creator of a work legal control over the duplication and public performance of their work.[21] In many jurisdictions, this is limited by a time period after which the works then enter the public domain.[22] Copyright laws are a balance between the rights of creators of intellectual and artistic works and the rights of others to build upon those works.[21] During the time period of copyright the author\u0027s work may only be copied, modified, or publicly performed with the consent of the author, unless the use is a fair use.[23] Traditional copyright control limits the use of the work of the author to those who either pay royalties to the author for usage of the author\u0027s content or limit their use to fair use. Secondly, it limits the use of content whose author cannot be found.[24] Finally, it creates a perceived barrier between authors by limiting derivative works, such as mashups and collaborative content.[25] Although open content has been described as a counterbalance to copyright, open content licenses rely on a copyright holder\u0027s power to license their work, as copyleft which also utilizes copyright for such a purpose.[26] Public domain Main article: Public domain Public domain symbol The public domain is a range of creative works whose copyright has expired or was never established, as well as ideas and facts[note 1] which are ineligible for copyright. A public domain work is a work whose author has either relinquished to the public or no longer can claim control over, the distribution and usage of the work. As such, any person may manipulate, distribute, or otherwise use the work, without legal ramifications. A work in the public domain or released under a permissive license may be referred to as \"copycenter\".[27] Copyleft Main article: Copyleft Copyleft symbol Copyleft is a play on the word copyright and describes the practice of using copyright law to remove restrictions on distributing copies and modified versions of a work.[28] The aim of copyleft is to use the legal framework of copyright to enable non-author parties to be able to reuse and, in many licensing schemes, modify content that is created by an auth",
