    "content": "Presko─Нi┼е na obsah z Wikip├йdie, slobodnej encyklop├йdie Vitajte vo Wikip├йdii, slobodnej encyklop├йdii, ktor├║ m├┤┼╛e upravova┼е ka┼╛d├╜. Dnes je pondelok 15. decembra 2025. Slovensk├б verzia m├б moment├бlne 257 132 ─Нl├бnkov. O Wikip├йdii тАв Pr├нru─Нka тАв Pomoc Najlep┼бie ─Нl├бnky тАв Port├бly тАв Kateg├│rie тАв A тАУ Z index 15. december Sediaci b├╜k Meniny m├б Ivica. 1791 тАУ bola prijat├б Listina pr├бv a stala sa s├║─Нas┼еou ├Ъstavy Spojen├╜ch ┼бt├бtov 1852 тАУ narodil sa Henri Becquerel, franc├║zsky in┼╛inier a fyzik, spoluobjavite─╛ r├бdioaktivity, laure├бt Nobelovej ceny (тАа 1908) 1860 тАУ narodil sa Niels Ryberg Finsen, d├бnsky lek├бr, laure├бt Nobelovej ceny (тАа 1904) 1890 тАУ zomrel Sediaci b├╜k, n├б─Нeln├нk indi├бnskeho kme┼Иa Siouxov (* asi 1831 тАУ 1837) 1923 тАУ narodil sa Freeman Dyson, britsko-americk├╜ teoretick├╜ fyzik a matematik, popularizoval koncept Dysonovej sf├йry (тАа 2020) 1939 тАУ v Atlante sa uskuto─Нnila premi├йra filmu Odviate vetrom 1966 тАУ zomrela ┼╜elm├нra Ga┼бpar├нkov├б, slovensk├б jazykovedky┼Иa a bibliografka (* 1901) 1978 тАУ americk├╜ prezident Jimmy Carter ozn├бmil, ┼╛e USA uzn├бvaj├║ ─М─╜R a preru┼бuj├║ diplomatick├й vz┼еahy s ─М├нnskou republikou 2013 тАУ zomrela Joan Fontaine, britsko-americk├б here─Нka, dr┼╛ite─╛ka Oscara (* 1917) ─Оal┼бie udalosti тАв Arch├нv тАв Zoznam historick├╜ch v├╜ro─Н├н Aktuality rusk├б inv├бzia na Ukrajinu chronol├│gia Maryja Kalesnikavov├б 13. december тАУ Bielorusko prepustilo 123 politick├╜ch v├дz┼Иov vr├бtane aktivistky za ob─Нianske pr├бva Maryje Kalesnikavovej a nosite─╛a Nobelovej ceny za mier Alesa Bia─╛ack├йho. 09. december тАУ prezident ─Мeskej republiky Petr Pavel vymenoval na Pra┼╛skom hrade Andreja Babi┼бa, predsedu hnutia ANO, za nov├йho premi├йra ─МR. 09. december тАУ rusk├б kozmick├б lo─П Sojuz MS-27 dopravila z Medzin├бrodnej vesm├нrnej stanice sp├д┼е na Zem rusk├╜ch kozmonautov Sergeja Ry┼╛ikova, Alexeja Zubrick├йho a americk├йho astronauta Jonnyho Kima, pri─Нom ich vystriedali dvaja rusk├н kozmonauti a americk├╜ astronaut, ktor├н na vesm├нrnu stanicu prileteli koncom novembra. 07. december тАУ majstrom sveta Formuly 1 v sez├│ne 2025 sa stal britsk├╜ pretek├бr Lando Norris, ktor├╜ z├нskal svoj prv├╜ titul a z├бrove┼И priviedol svoj t├нm McLaren k zisku Poh├бra kon┼бtrukt├йrov. 20. november тАУ na r├╜chlostnej ceste R2 otvorili 9,1-kilometrov├╜ ├║sek Kriv├б┼И тАУ M├╜tna, ktor├йho s├║─Нas┼еou je 5 km dlh├б mostn├б estak├бda v ├║dol├н Kriv├бnskeho potoka. 17. november тАУ b├╜val├б banglad├й┼бska premi├йrka Has├нna Wad┼╛├нdov├б bola v nepr├нtomnosti uznan├б vinnou zo zlo─Нinov proti ─╛udskosti a ods├║den├б na trest smrti. ├Ъmrtia: W┼Вadys┼Вaw Siemaszko (106) Marian Kotleba (73) O─╛ga Feldekov├б (82) Frank Gehry (96) G├йza Erd├йlyi (88) Pier Enrico Stefanetti (73) Udo Kier (81) Juraj Lexmann (84) Sally Kirklandov├б (84) Frederick Hauck (84) ─Оal┼бie udalosti Odpor├║─Нan├╜ ─Нl├бnok V starovekom Gr├йcku sa z keramiky (z p├бlenej hliny ─Нi terakoty) vyr├бbalo ve─╛k├й mno┼╛stvo n├бdob rozli─Нn├╜ch tvarov a funkci├н, ktor├й sa ─Нasto prekr├╜vali. Nevyr├бbali sa len n├бdoby, ako s├║ d┼╛b├бny a n├бdoby na pitie a jedlo, ale i tak├й predmety, ako ve─╛k├й kade, pece, sarkof├бgy, kanvice, vedr├б, panvice, ma┼╛iare na drvenie, kozmetick├й skrinky, hra─Нky, sochy, so┼бky, architektonick├й ozdoby, lampy a dekorat├нvne predmety (─Нi n├бdoby). Keramick├й v├╜robky sa pou┼╛├нvali tie┼╛ pri obchodovan├н, v remesl├бch a verejnom ┼╛ivote, napr├нklad ako hlasovacie urny, vodn├й hodiny, odmerky na tekutiny ─Нi sypk├й l├бtky. Keramick├й n├бdoby, napr. ─Нiernofig├║rov├й panathenajsk├й amfory sa d├бvali ako ceny pre v├н┼еazov na hr├бch. O nev┼бednom keramickom tovare s umeleck├╜m zdoben├нm sa toho vie viac, lebo sa ─Нasto zachoval v hrobk├бch relat├нvne nepo┼бkoden├╜. Menej vedomost├н je o oby─Нajn├╜ch ka┼╛dodenn├╜ch predmetoch, napr├нklad pou┼╛├нvan├╜ch v kuchyni, aj ke─П boli vo v┼бetk├╜ch obdobiach zrejme be┼╛nej┼бie. Vo v├╜vinovej l├нnii (chronologicky) sa v├╜zdoba starogr├йckej keramiky rozli┼бuje na geometrick├║, orientalizuj├║cu, ─Нiernofig├║rov├║, ─Нervenofig├║rov├║, na bielom podklade a neskor├║. Gr├йcke keramick├й n├бdoby svojou ┼бt├╜lovou rozmanitos┼еou a roz┼б├нren├нm po celom gr├йckom svete (a jeho okol├н) sp├┤sobili b├бdate─╛om nem├бlo starost├н. Tvar (typ) n├бdoby sa ale niekedy dal ur─Нi┼е pomerne jednoducho, ob─Нas bol nejak├╜ antick├╜ term├нn pou┼╛it├╜ na z├бklade dohody. Av┼бak o zn├бmych n├бzvoch niektor├╜ch tvarov n├бdob, v├д─Н┼бinou tu ide atick├║ okrasn├║ keramiku, sa u┼╛ dnes vie, ┼╛e s├║ nespr├бvne (niekedy sa toti┼╛ vyr├бbali aj novinky typov v├бz, pod─╛a po┼╛iadavok u┼╛├нvate─╛a). Rovnak├╜ tvar mohla ma┼е i celkom prost├б n├бdoba i n├бdoba kr├бsne zdoben├б. Najbe┼╛nej┼б├нm zdoben├╜m typom n├бdob boli poh├бre. Niektor├й tvary n├бdob sa vyr├бbali aj z in├╜ch materi├бlov, napr├нklad z kame┼Иa ─Нi kovu. cel├╜ ─Нl├бnok... Arch├нv тАв Dobr├й ─Нl├бnky тАв Najlep┼бie ─Нl├бnky Vedeli ste, ┼╛e... тАжb├╜val├╜ hr├б─Н bedmintonu a olympionik Li Jang sa v septembri 2025 stal prv├╜m ministrom ┼бportu na Taiwane? тАжGymnopaidia bola spartsk├б sl├бvnos┼е, pod─╛a trad├нcie zalo┼╛en├б v roku 669 pred Kr., zah┼Х┼Иaj├║ca tance a cvi─Нenia mu┼╛ov a nah├╜ch mlad├нkov тАжS─╛a┼╛iansky potok tvor├н hranicu ├║zem├н s Vel─Нicami a Mankovcami a vlieva sa do ─Мere┼б┼Иov├йho potoka? тАжMajstrovstv├б sveta vo futbale ┼╛ien 2023 boli prv├й, ktor├й sa konali v dvoch ┼бt├бtoch Austr├бlia a Nov├╜ Z├йl",
